INSERT INTO `product` (`id`, `category_id`, `name`, `detail`, `image`, `keyword`, `view`, `rating`, `phone`, `facebook`, `instagram`, `line_id`, `email`, `youtube`, `website`, `timeline`, `startprice`, `endprice`, `keyword2`, `member`, `first`, `latitude`, `longitude`, `priority`, `detail_en`, `detail_cn`, `updated_at`) VALUES
(12, 23, 'Anyadharu', 'ANYADHARU เกิดขึ้นเพราะเรื่องราวอันน่ามหัศจรรย์ของกลิ่น เราแน่ใจว่าคุณค่าแห่งกลิ่นมี มากกว่าความหอมเพียงชั่วครู่ เราจึงตั้งใจที่จะศึกษาเรื่องของกลิ่นอย่างจริงจัง และถ่ายทอดกลิ่นต่างๆ ผ่านทางเครื่องหอมนานาชนิด เพื่อที่เราจะเก็บความทรงจำแห่งกลิ่นได้หลากหลายและนำมาใช้ในชีวิต ประจำวันได้ง่าย และตรงตามความต้องการ ความทรงจำแห่งกลิ่นคือความทรงจำอันละเอียดอ่อนของมนุษย์ เราจดจำและบันทึกเรื่องราวแห่งกลิ่น แต่ละกลิ่นไว้ในเบื้องลึกของจิตใจ ทั้งในยามที่เรารู้ตัวและไม่รู้ตัว แม้ว่าวันเวลาผ่านไปนานเช่นใด\r\nแต่เมื่อไรก็ตามหากกลิ่นที่เราเคยคุ้นแผ่วผ่านมาให้รับรู้ เมื่อนั้นประตูแห่งความทรงจำของเราจะเปิด\r\nออก ย้อนเวลาให้เราได้กลับไประลึกถึงคืนวันเก่าก่อน... กลิ่นกายอบอุ่นของแม่ กลิ่นไม้ชื้นฝน\r\nของห้องนอนในคืนฝนตก กลิ่นดอกมะลิเมื่อรุ่งสาง กลิ่นตุ๊กตาตัวโปรดที่เราเคยกอดนอน ... \r\nช่วงเวลาเหล่านั้นคือความรื่นรมย์ สุข สงบ ที่เราคิดถึงเสมอ และบ่อยครั้งยังสร้างแรงบันดาลใจ\r\nให้กับชีวิตวันปัจจุบันของเราด้วย \r\n\r\nANYADHARU เกิดขึ้นเพราะเรื่องราวอันน่ามหัศจรรย์ของกลิ่น เราแน่ใจว่าคุณค่าแห่งกลิ่นมี มากกว่าความหอมเพียงชั่วครู่ เราจึงตั้งใจที่จะศึกษาเรื่องของกลิ่นอย่างจริงจัง และถ่ายทอดกลิ่นต่างๆ ผ่านทางเครื่องหอมนานาชนิด เพื่อที่เราจะเก็บความทรงจำแห่งกลิ่นได้หลากหลายและนำมาใช้ในชีวิต ประจำวันได้ง่าย และตรงตามความต้องการ \r\n\r\nANYADHARU หวังว่าเครื่องหอมที่ทำขึ้นจากความตั้งใจของเรา จะมีส่วนในการนำพาความสุขสงบ รื่นรมย์ และแรงบันดาลใจที่ดีงาม มาสู่วิถีชีวิตของคุณ...ANYADHARU realizes that a quality fragrance is more than just a whiff of indulgence. Under the ANYADHARU brand, eclectic selections of pleasurable fragrance were intuitively created in the way Asian people have long treasured through various products such as incense sticks, scented candles, scented sachets, and more; in order to fulfill your desire. \r\n\r\nLet ANYADHARU, which has been created from the heart, be part of your revitalization and bring holistic peace of mind, cherished with vivacious inspiration to you.', '1530673731.jpg', 'ตลาดจตุจักร 122-123 โครงการ 3 ซอย 43', 5936, 5, '083 005 2106', 'Anyadharu-111430468948883', 'ไม่ระบุ', 'ไม่ระบุ', 'info@anyadharu.com', 'ไม่ระบุ', 'www.anyadharu.com', '1447167450-1.jpg', 175, 1000, 'ร้านขายหัวน้ำหอม,เครื่องหอม,น้ำมันหอมระเหย,น้ำหอม,ของขวัญ, น้ำมันธรรมชาติ, น้ำมัน', 0, 0, 13.799301703383552, 100.55076278083249, 1, '.ANYADHARU realizes that a quality fragrance is more than just a whiff of indulgence. Under the ANYADHARU brand, eclectic selections of pleasurable fragrance were intuitively created in the way Asian people have long treasured through various products such as incense sticks, scented candles, scented sachets, and more; in order to fulfill your desire. \r\n\r\nLet ANYADHARU, which has been created from the heart, be part of your revitalization and bring holistic peace of mind, cherished with vivacious inspiration to you.', 'ANYADHARU意識到質量的香味不僅僅是一個放縱的味兒了。根據ANYADHARU品牌，愉快的香味不拘一格選在路上亞洲人民早就通過各種產品，如熏香，香味蠟燭，香味袋，更珍貴的是直覺創造的;為了滿足您的願望。\r\n\r\n讓ANYADHARU，它已經從心臟創建的，是你的振興的一部分，帶來心靈的全面和平，以活潑的靈感，你珍惜。.', '2018-07-04 03:08:51'),
(13, 21, 'Junktion', 'ร้านขายของชำแนว Zakka ที่มีสินค้าหลากหลาย เหมือนโกดังเล็กๆ กลางจัตุจักร \r\nและยังมีสาขาJunktion@Emporium ที่ตั้ง ห้าง Emporium แผนก Living Zone ชั้น 4 \r\n\r\nเจ้าของใจดีมากครับ', '1452518930-JJMARKET.jpg', 'เลขที่ 150 โครงการ 2 ซอย 39/1 (ที่ตั้ง 50 เมตร จากทางออกประตู 2 ของสถานีรถไฟใต้ดิน MRT สถานี\r\nJatujak Plaza โซน B ซอย 4 ห้องที่ 72', 2294, 4, '081 692 3478', 'Junktionetc', 'junktion.jj', 'ไม่ระบุ', 'junktion.jj@gmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1447167321-1.jpg', 30, 1500, 'ของตกแต่งบ้าน, จาน, ช้อน, Zakka, ร้านขายของชำแนว Zakka ที่มีสินค้าหลากหลาย เหมือนโกดังเล็กๆ กลางจัตุจักร', 0, 0, 13.799434, 100.5503616, 2, '\r\nZakka groceries with a variety of products. Like a small warehouse in the middle of the mill.\r\nThere is also Junktion @ Emporium branch at the Emporium department store, Living Zone, 4th floor.\r\n\r\nThe owner is very kind.', 'ZAKKA與多種產品一起雜貨。就像一個小倉庫的Chatuchak。\r\n它也有分支Junktion @商場的商場百貨樓生活區4。\r\n\r\n非常好客的業主', NULL),
(15, 19, 'Hammersmith', '"รองเท้าหนังแท้ เสื้อผ้า ตัดเย็บอย่างดี" \r\n\r\nถ้าคุณผ่านร้านนี้ แล้วไม่หยุดแวะดู คุณจะพลาดโกาสครั้งสำคัญในการมาจตุจักร พบกับนิยาย ของ ผู้ชายเท่ห์ได้ที่ร้านนี้เลยครับ\r\n\r\nVintage Look!!!\r\nSimple and Classy with our new collection, Men\'s Lace Up Oxford Shoes, Dark Green Colour.', '1446636890-JJMARKET 0243.jpg', 'Exit 2', 3819, 5, '089 927 5025', 'HAMMERSMITHSHOES', 'ไม่ระบุ', 'ไม่ระบุ', 'hammersmithshoes@gmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1447165785-1.jpg', 1000, 3200, 'รองเท้าหนังแท้,เสื้อผ้า, ตัดเย็บอย่างดี,รองเท้าผู้ชาย', 0, 1, 13.79919881412011, 100.55077592916734, 3, 'Vintage Look!!!\r\nSimple and Classy with our new collection, Men\'s Lace Up Oxford Shoes, Dark Green Colour.\r\n\r\nHammersmith\'s motto is, “Simple to perfect.” We believe shoes always play a big role in any wardrobe, from suits to jeans. With one great pair, you can call it a day and this is the reason we provide great leather shoes. Let\'s become a part of our journey, step by step!\r\n\r\nHAMMERSMITH SHOP LOCATION: Chatuchak Weekend Market \r\n\r\nSection: MRT Kamphaeng Phet Station(Underground Train Station)\r\n\r\nOpening Hours: Sat-Sun 10:00 am -19:00 pm\r\n\r\nHandmade, high quality leather shoes and products.\r\nPassion, Craftsmanship, Cutting-edge and Perfect-Fit.', 'Vintage Look!!!\r\nSimple and Classy with our new collection, Men\'s Lace Up Oxford Shoes, Dark Green Colour.\r\n\r\nHammersmith\'s motto is, “Simple to perfect.” We believe shoes always play a big role in any wardrobe, from suits to jeans. With one great pair, you can call it a day and this is the reason we provide great leather shoes. Let\'s become a part of our journey, step by step!\r\n\r\nHAMMERSMITH SHOP LOCATION: Chatuchak Weekend Market \r\n\r\nSection: MRT Kamphaeng Phet Station(Underground Train Statio', '2018-07-08 03:52:46'),
(23, 19, 'Vara', 'กระเป๋าหนัง พวงกุญแจ Handmade คุณภาพดีเยี่ยม สวย ทันสมัย\r\n\r\n\r\nA leather bag is not simply just another bag. It is an investment. It is something that will stay with you for decades.”\r\n\r\n\r\nThe inspiration behind Vara is simple, leather products to suit anything that’s on your agenda. The hallmark of Vara is its classic, simple designs. This allows for the creation of a bag that is both durable and lightweight. Every product from Vara is handmade using high quality pieces of leather hand picked by the company’s owners.', '1451063162-DSC_0019.jpg', '175,185 โครงการ 2 ซอย 38 \r\nChatuchak Weekend Market Section 2 ', 3176, 4, '096 251 1996', 'varaleather', 'varabrand', 'varabrand', 'varaagenda@hotmail.com', 'ไม่ระบุ', 'http://www.varabrand.com/', '1459353901-10710981_529760887155154_3401827905442462334_n.jpg', 149, 5890, 'กระเป๋าหนัง, พวงกุญแจ, Handmade, ', 1, 1, 13.799434, 100.5503616, 4, 'A leather bag is not simply just another bag. It is an investment. It is something that will stay with you for decades.”\r\n\r\n\r\nThe inspiration behind Vara is simple, leather products to suit anything that’s on your agenda. The hallmark of Vara is its classic, simple designs. This allows for the creation of a bag that is both durable and lightweight. Every product from Vara is handmade using high quality pieces of leather hand picked by the company’s owners.', 'A leather bag is not simply just another bag. It is an investment. It is something that will stay with you for decades.”\r\n\r\n\r\nThe inspiration behind Vara is simple, leather products to suit anything that’s on your agenda. The hallmark of Vara is its classic, simple designs. This allows for the creation of a bag that is both durable and lightweight. Every product from Vara is handmade using high quality pieces of leather hand picked by the company’s owners.', NULL),
(24, 18, 'Brio bkk', 'เสื้อสไตร์ไม่เหมือนใคร พร้อมที่จะให้ความโดดเด่นกับผู้ส่วมใส่ และเป็นผู้นำเทรนด์ ร้านอยู่ตรงหัวมุม เลยไปด้านในจะเห็นร้านขายกาฟ น่ารักๆ อยู่ติดกัน เจ้าของเดียวกัน เป็นกันเอง หล่อ สวยแล้ว ก็เลยเข้าไปพักเหนื่อยด้านในได้เลย ', '1455202940-DSC_0134.jpg', 'ตลาดนัดจตุจักร 180,190 โครงการ 2 ซอย 2', 1832, 3, '099 154 5966', 'ไม่ระบุ', 'brio_bkk', 'ไม่ระบุ', 'brio_clothing@yahoo.com', 'ไม่ระบุ', 'http://www.teeneejj.com/shop-24', '1455202859-IMG_2149.jpg', 250, 800, 'เสื้อแขนยาว,แว่นตา,เสื้อเชิ้้ต, Shirt, กางเกงขายาว', 1, 0, 13.799434, 100.5503616, 5, '\r\nStylish shirt like no other. Ready to stand out with the wearer. And a trend leader. The shop is at the corner. In the inside, you will see a lovely gourmet store next door, the same owner is pretty handsome, so I went to stay tired at all.', '時尚的襯衫就像沒有別的。準備與佩戴者脫穎而出。和一個趨勢領導者。商店在拐角處。在裡面，你會看到一個可愛的美食店隔壁，同一位業主很漂亮，所以我去累了。', '2018-07-08 01:33:15'),
(25, 30, 'Brio Bistro bar', 'รสชาติที่ไม่ธรรมดา พร้อมบรรยากาศง่ายๆ ทั้งเครื่องดืม อย่าลืมสั่งพิซซ่ารสเยี่ยมได้ที่นี่\r\n\r\nBrio Bistro & Bar offers freshly baked pizza, cocktails, mocktails, selection of smoothies, and refreshing drinks every weekend at JJ Market Section 2.', '1451141170-DSC_0149.jpg', '180,190 โครงการ 2 ซอย 2', 1082, 4, '099 154 5966', 'briobistroandbar', 'briobistroandbar', 'ไม่ระบุ', 'briobkk.info@gmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1452153909-DSC_0158.jpg', 30, 300, 'พิซซ่า, กาแฟ, เครื่องดืม', 0, 0, 13.799434, 100.5503616, 6, 'รสชาติที่ไม่ธรรมดา พร้อมบรรยากาศง่ายๆ ทั้งเครื่องดืม อย่าลืมสั่งพิซซ่ารสเยี่ยมได้ที่นี่\r\n\r\nBrio Bistro & Bar offers freshly baked pizza, cocktails, mocktails, selection of smoothies, and refreshing drinks every weekend at JJ Market Section 2.', 'รสชาติที่ไม่ธรรมดา พร้อมบรรยากาศง่ายๆ ทั้งเครื่องดืม อย่าลืมสั่งพิซซ่ารสเยี่ยมได้ที่นี่\r\n\r\nBrio Bistro & Bar offers freshly baked pizza, cocktails, mocktails, selection of smoothies, and refreshing drinks every weekend at JJ Market Section 2.', NULL),
(26, 18, 'One upon a time', 'ร้านขายเสื้อเด็กน่ารัก เรียบ สวยงาม ตั้งแต่แรกเกิด จนถึง3-4ปี อยากจะกลับไปเป็นเด็กอีกครั้ง หลังจากเห็นเสื้อผ้าร้านนี้ สวยงาม น่ารัก เหมาะสำหรับทุกคนที่ต้องการให้เด็กๆของคุณ น่ารัก น่าชัง ไม่เหมือนใคร', '1459436723-10149831_655092541205934_45251021_n.jpg', 'ตลาดจตุจักร โครงการ 2 ซอย 39/2 เลขที่ 231-241', 3178, 4, '081 985 6186, 081 617 5669', 'Once-Upon-A-Time-Kiddy-483852041663319/', 'onceuponatimekiddy', 'ไม่ระบุ', 'oneuponatimekiddy@gmail.com', 'ไม่ระบุ', 'http://www.onceuponatimekiddy.com/', '1446992982-IMG_2159.jpg', 100, 850, 'ร้านขายเสื้อเด็กน่ารัก, เรียบ, สวยงาม, แรกเกิด, 3-4ปี, รองเท้าเด็ก, กระเป๋าเด็ก', 1, 0, 13.799434, 100.5503616, 7, 'Shop for cute tops children from birth to a beautiful 3-4 years to return to being a child again. After seeing this lovely clothing store for everyone who wants to give your kids pretty well.', '店從出生可愛上衣的孩子一個美麗的3 - 4年再回到作為一個孩子。看到這個可愛的服裝店大家誰願意給你的孩子非常好了。', '2018-06-25 12:43:03'),
