(29, 18, 'repeat after me', 'เสื้อผ้าหลากหลายแนว อัพเดททุกเดือนตามช่วงฤดูกาลและกระแสนิยม มีห้องรองเสื้อผ้าสำหรับลูกค้า\r\nRetailer Women\'s wear."Simple Way Always Classy" เดินทางง่ายๆด้วย mrt ลงสถานีกำแพงเพชร ออกทางออกตลาดนัดสวนจตุจักร ขึ้นบันไดเลื่อนมาเดินออกขวาเข้าโครงการริมรั้ว ร้านอยู่โครงการ 2 มองขวามือเรื่อยมา เจอห้อง 302 พบกับร้าน Repeat After Me & Gusnot Brand ได้ที่นี่นะคะ', '1446994140-IMG_2180.jpg', 'JJ Weekend Market Sec 2 Soi 41/2 Gate 28 Room 302', 1775, 4, '086 363 0313', 'repeataftermefanpage', 'ไม่ระบุ', 'pannpiywd', 'repeat_after_me@live.com', 'ไม่ระบุ', 'ไม่ระบุ', '1459437945-1925134_777926355587245_4371934940553268406_n.jpg', 200, 800, 'เสื้อแขนยาว,แว่นตา,เสื้อเชิ้้ต, Shirt, กางเกงขายาว, เสื้อโปโล', 1, 0, 13.799434, 100.5503616, 10, 'เสื้อผ้าหลากหลายแนว อัพเดททุกเดือนตามช่วงฤดูกาลและกระแสนิยม มีห้องรองเสื้อผ้าสำหรับลูกค้า\r\nRetailer Women\'s wear."Simple Way Always Classy"', 'เสื้อผ้าหลากหลายแนว อัพเดททุกเดือนตามช่วงฤดูกาลและกระแสนิยม มีห้องรองเสื้อผ้าสำหรับลูกค้า\r\nRetailer Women\'s wear."Simple Way Always Classy"', '2018-06-24 15:56:15'),
(30, 18, 'a.m.p clothing', 'เสื้อผ้า Street wear ก่อตั้งตั้งแต่ 2003 สินค้าคุณภาพในราคาย่อมเยา STREET BRAND FROM BANGKOK THAILAND WITH DEEP ROOT IN ROCK MUSIC, TATTOO, SKATEBOARD, GRAFFITI, AND STREET ART.\r\n\r\n', '1451141330-DSC_0327.jpg', ' ตลาดจตุจักร โครงการ2 ซอย 42 ', 2980, 5, '086 393 6568', 'ampbkk', 'ไม่ระบุ', 'ไม่ระบุ', 'AMPBKC@GMAIL.COM, AMPCLOTHING01@HOTMAIL.COM, AMPBKK1@HOTMAIL.COM', 'ไม่ระบุ', 'www.ampbkk.com', '1452154846-DSC_0311.jpg', 150, 550, 'เสื้อยืด, street wear', 1, 0, 13.799434, 100.5503616, 11, ' STREET BRAND FROM BANGKOK THAILAND WITH DEEP ROOT IN ROCK MUSIC, TATTOO, SKATEBOARD, GRAFFITI, AND STREET ART.\r\n\r\n.M.P. is out on the streets of Bangkok since 2002. The Brand represents the lifestyle of its founders and their surrounding. Influences come from rock music, street art, urban fashion, graphic design, skateboard culture and the art of tattooing. A.M.P developed out of the love to its activities and is dedicated to produce products without limitations to their styles.\r\n\r\n“We decided to make our own clothing line for people who love the same lifestyle.”\r\n\r\nThe brand is specialized in hand screen-printing and strives to create a new design every week. Focusing on men apparel the line also includes accessories, handmade artwork on canvas as well as custom-made tattoos at the brands in store tattoo studio.\r\n\r\nA.M.P is inspired by our direct environment, things they see and experience in daily life. Ideas are gathered and brought to paper to channel the input and create an intensified output. We amplify what is out on the streets, that’s what makes A.M.P.\r\n\r\nBesides other projects A.M.P is preparing a artist project which we will invite artists to collaborate in designing tees. These shirts will be very limited collector’s items.\r\n\r\nA.M.P is constantly working on new designs and we always keep our eyes open for new things. We’re inspired by the people and we hope that people can be inspired by us, too.', '街頭品牌從曼谷泰國深層根源搖滾樂，紋身，滑板，塗鴉和街頭藝術。\r\n\r\n.M.P。是出來曼谷街頭自2002年品牌代表其創始人的生活方式和其周圍。影響來自搖滾音樂，街頭藝術，都市時尚，平面設計，滑板文化和紋身的藝術。 A.M.P研製出來的愛的活動，致力於生產出的產品不限制自己的風格。\r\n\r\n“我們決定讓我們的誰愛同樣的生活方式的人自己的服裝生產線。”\r\n\r\n該品牌是專門從事手工絲網印刷和努力每週都創造了新的設計。著眼於男性服飾的線還包括飾品，手工藝術品在畫布上，以及定制的紋身在紋身店的工作室品牌。\r\n\r\nA.M.P是我們的直接環境的啟發，他們看到的東西和日常生活經驗。想法是收集並提請紙通道的輸入，並創建一個愈演愈烈的輸出。我們放大什麼是在街頭，這是什麼使得A.M.P.\r\n\r\n除了其他項目A.M.P正在準備一個藝術家的項目，我們將邀請藝術家設計的T卹進行合作。這些襯衫將是非常有限的收藏品。\r\n\r\nA.M.P不斷致力於新的設計，我們始終保持我們的眼睛開放的新事物。我們正在受到人們的啟發，我們希望人們可以由我們的啟發，太。', '2018-07-04 19:59:44'),
(31, 18, 'Twentysecond', 'เสื้อผู้ชาย เนียบ หรูหรา น่าส่วมใส \r\n\r\nTwentysecond is a Bangkok-based menswear label established in 2007. Originally started by two partner who love to tailor their own clothes and finally become a label.\r\n\r\nWe are all consumer that know what a customer want. The finest materials and a high skill workmanship together with a minimal and wearable design are the 3 main reasons for purchasing one man’s shirt.\r\n\r\nWe source a high quality fabric, buttons and high quality workmanship from the best and make the clothes in Bangkok,Thailand. The design is minimal with a slightly details so people can combine in their own way. Finally deliver to our customer with a reasonable & affordable price.\r\n\r\n"We make clothing we like to wear ourselves” is the core value that we concern for every pieces of our product.', '1451141373-DSC_0277.jpg', ' SIAMSQUARE SOI 2\r\nJATUJAK SECTION 3 SOI 2 ROOM 049', 1660, 4, '087 703 8383', 'thetwentysecond', 'thetwentysecond', '@twentysecond', 'thetwentysecond@hotmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1446994722-IMG_2197.jpg', 350, 1200, 'เสื้อแขนยาว, แว่นตา,เสื้อเชิ้้ต, Shirt, กางเกงขายาว,Menswear, Made to Order,  Wholesale & Retail', 1, 0, 13.799434, 100.5503616, 12, 'เสื้อผู้ชาย เนียบ หรูหรา น่าส่วมใส \r\n\r\nTwentysecond is a Bangkok-based menswear label established in 2007. Originally started by two partner who love to tailor their own clothes and finally become a label.\r\n\r\nWe are all consumer that know what a customer want. The finest materials and a high skill workmanship together with a minimal and wearable design are the 3 main reasons for purchasing one man’s shirt.\r\n\r\nWe source a high quality fabric, buttons and high quality workmanship from the best and make the clothes in Bangkok,Thailand. The design is minimal with a slightly details so people can combine in their own way. Finally deliver to our customer with a reasonable & affordable price.\r\n\r\n"We make clothing we like to wear ourselve