(42, 30, 'Jatujak Ancient Grass Jelly', 'เฉาก๊วยโบราณ ใส่น้ำตาลอ้อย เฉาก๊วยน้ำสด เฉาก็วยชาเย็น เฉาก็วยชาเขียว ร้านเฉาก๋วยเจ้าเก่า ดั้งเดิม \r\n"เวลาเดินร้อนๆ หมดแรง หาที่พักเท้า อยากพักดื่มอะไรเย็นๆดับกระหาย แนะนำร้านนี้เลย เป็นร้านเก่าแก่ที่ขายมานาน\r\nร้านนี้ผู้คนผ่านไปผ่านมาตลอด อยู่ตรงโซนขายต้นไม้ในอดีต\r\nตอนนี้โซนนี้เปลี่ยนไปมากแล้วเพราะมีแต่ร้านเสื้อผ้ามาขายกัน\r\nร้านนี้โดดเด่นตรงเฉาก๋วยมีเนื้อที่เหนียวเด้ง และมีน้ำตาลกรวด\r\nโรยช่วยเพิ่มรสชาติให้ความสดชื่อเวลาร้อนและดับกระหายได้เป็นอย่างดีทีเดียวละคับ" คุณ Narakitpong Jesada บอกไว้', '1447173095-IMG_2250.jpg', '202 214 โครงการ 3 ซอย 44/2', 990, 4, '086 568 7025', 'จัตุจักรเฉาก๊วยโบราณ', 'ไม่ระบุ', 'ไม่ระบุ', 'duangklom@hotmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1447173095-2.jpg', 30, 40, 'เฉาก๊วยโบราณ, ใส่น้ำตาลอ้อย, เฉาก๊วยน้ำสด, เฉาก็วยชาเย็น, เฉาก็วยชาเขียว', 1, 0, 13.799434, 100.5503616, 0, 'เฉาก๊วยโบราณ ใส่น้ำตาลอ้อย เฉาก๊วยน้ำสด เฉาก็วยชาเย็น เฉาก็วยชาเขียว', 'เฉาก๊วยโบราณ ใส่น้ำตาลอ้อย เฉาก๊วยน้ำสด เฉาก็วยชาเย็น เฉาก็วยชาเขียว', NULL),
