(45, 18, 'Masque 17:09', 'T-shirt vintage เสื้อผ้าสวมใสสบาย For edgy men’s and women’s clothing head to Masque & 17:09, a wooden fronted boutique in section 3. The collection focuses on casual wear, with racks of patterned shirts, shorts and a small selection of natty trilbies for the guys and T-shirt dresses, blouses and boyfriend jeans for the girls. On our last visit we couldn’t help but return with bags of goodies, including a paint-dipped T-shirt at 280 baht, a short polka dot dress at only 550 baht and a canvas shopper that has an old Vogue sketch printed on both sides for 580 baht. One of the greatest things about Chatuchak Weekend Market is the chance to discover up and coming labels and designers. Masque and 17:09 really encompass this by offering original fashion for both men and women.\r\n', '1461220454-1460992354-DSC_0487.jpg', '293 โครงการ 3 ซอย 46/2', 2736, 4, '081 564 4363 ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'masque1709@gmail.com', 'ไม่ระบุ', 'www.masque1709.com', '1447225840-1.jpg', 150, 500, 'เสื้อยืด, T-shirt, สไตร์วินเทจ ', 1, 0, 13.799434, 100.5503616, 0, 'T-shirt vintage เสื้อผ้าสวมใสสบาย', 'T-shirt vintage เสื้อผ้าสวมใสสบาย', '2018-07-07 17:26:31'),
