(47, 30, 'the breakfast club', 'กาแฟสดใหม่ทุกวัน อยากให้มาลองชิม คนขายใจดี พร้อมบริการ สองสาวคนนี้ มีความใฝ่ฝันที่จะมี คาเฟ่ เป็นของตัวเอง พอโอกาสมาถึง ทั้งคู่ก็ไม่พลาดที่จะคว้ามันไว้ กิมมิคพิเศษของคาเฟ่ที่นี้ คือ เรื่องดีไซน์ของแพกเกจ และรสชาติ เรียกว่า ทั้งสองคนต้องทำการทดลองแล้วทดลองอีก จนกว่าจะได้รสชาติที่เป็นที่พอใจ แถมทั้งคู่ยังเดินทางไปหาแรงบันดาลใจจากประเทศ เกาหลีเลยนะคะ Recommend ของร้านนะคะ ที่ใครแวะมาต้องห้ามพลาดเชียวเลยนะ กับเมนู Honey lemon crumble soft serve\r\n\r\nอู้ววว สวยงามน่าทานไหมละคะ เป็นไอศครีม ซอฟเสิรฟ รสโยเกิตน้ำผึ้ง จุดเด่นของไอศครีมที่นี้คือ กลิ่นที่หอมของน้ำผึ้งที่ผสมกับโยเกิตทำให้ เกิดรสชาติหอมหวาน อมเปรี้ยวนิดๆของโยเกิร์ต ทำให้เกิดรสชาติที่ลงตัวสุดๆไปเลยค่ะ วัตุดิบที่ใช้ของทางร้านก็เป็นของ organic ค่ะ https://article.shopspotapp.com/ss-article/the-breakefast-club-cafe/', '1461683804-12970961_218792278480214_8499483259757549388_o.jpg', '265 โครงการ 3 ซอย 46/1', 648, 4, '081 554 7954', 'thebreakfastclub.bkk', 'thebreakfastclubbkk', 'ไม่ระบุ', 'thebreakfastclub.bkk@gmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1447228055-1.jpg', 45, 100, 'กาแฟสด', 1, 0, 13.799434, 100.5503616, 0, 'กาแฟสดใหม่ทุกวัน อยากให้มาลองชิม คนขายใจดี พร้อมบริการ', 'กาแฟสดใหม่ทุกวัน อยากให้มาลองชิม คนขายใจดี พร้อมบริการ', NULL),
(48, 18, 'Twelve P.m.', 'All about animal design ร้านสองสาวพี่น้อง สองลุคสองสไตล์ ร้าน Twelve PM จะเน้นหลักไปทางเสื้อเชิ้ต และเสื้อยืดลายน้องสัตว์น่ารักๆขนมาเพียบ ทั้ง น้องหมา น้องแมว น้องกวาง น้องกระรอก เยอะมากเลยอ่ะ ขอบอก แถมแต่ละตัวก็น่ารักทั้งนั้น ที่เด็ดคือ คุณภาพเสื้อร้านนี้ดีมาก แอดมินยืนยัน http://article.shopspotapp.com/ss-article/45-shops-jj/', '1447228776-IMG_2294.jpg', '266 โครงการ 3 ซอย 46/1', 1587, 4, '086 670 1006', 'twelvepm12', 'Twelvepm', 'ไม่ระบุ', 'Twelvepm12@hotmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1447228776-1.jpg', 250, 350, 'เสื้อผ้าผู้หญิง, หวานๆ, เสื้อกระโปรงยาว, ', 1, 0, 13.799434, 100.5503616, 0, 'All about animal design', 'All about animal design', '2018-07-07 17:26:33'),
(49, 19, 'The sash', 'กระเป๋า Backpack งานแคนวาสและหนังแท้เกรดนำเข้า ตัดเย็บด้วยความปราณีต ด้วยมาตรฐานสูง Bag,Backpage,Wallet,belt,Passport holder,Card holder,Shoe', '1460979944-IMG_2306.jpg', '072 โครงการ 4 ซอย 48/1', 1387, 3, '089 269 6229', 'www.facebook.com/thesashthailand', 'ไม่ระบุ', 'thesashthailand', 'thesashthailand@gmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1447229217-1.jpg', 200, 1200, 'กระเป๋า, Backpack, งานแคนวาส, หนังแท้, เกรดนำเข้า, ตัดเย็บด้วยความปราณีต, ด้วยมาตรฐานสูง, Bag,Backpage,Wallet,belt,Passport holder,Card holder,Shoe', 1, 1, 13.799434, 100.5503616, 0, 'กระเป๋า Backpack งานแคนวาสและหนังแท้เกรดนำเข้า ตัดเย็บด้วยความปราณีต ด้วยมาตรฐานสูง', 'กระเป๋า Backpack งานแคนวาสและหนังแท้เกรดนำเข้า ตัดเย็บด้วยความปราณีต ด้วยมาตรฐานสูง', NULL),
(50, 18, 'A laboratory', 'เสื้อผ้าร่วมสมัย เสื้อผู้หญิงทำงาน ลำลองและ unisex ภายใต้โทนขาวดำ รวมไปถึงสินค้า vintage jeans A Laboratory or ALAB, established in 2006, is a brand originated from an embodiment of experiences as a Thai-brand designer for over 10 years, whose each design has been inspired by travel, places and everyday life incident; thus, emerging into the clothing style of Street Wear. The style is as Asian as Japanese, blended harmoniously with a scent of English luxury to match the taste of Thai people. It’s easy to wear, along with reasonable price, but never neglecting designing and sewing details.\r\n\r\nStay updated on ALAB’s new collections on our Fan Page, or\r\n\r\nA Laboratory หรือ ALAB ตั้งขึ้นในปี 2006 เป็นแบรนด์ ที่เกิดจากการรวบรวมประสบการณ์การเป็นดีไซน์เนอร์เสื้อผ้าแบรนด์ไทยมากว่า 10 ปีที่ แต่ละดีไซน์ได้แรงบันดาลใจมาจากการเดินทาง สถานที่ และ สิ่งที่พบเห็นในชีวิตประจำวัน ออกมาเป็นเสื้อผ้าจะเป็นสไตล์ Street Wear ในสไตล์เอเชียอย่างญี่ปุ่น มีกลิ่มอายความหรูหราในสไตล์อังกฤษมา ผสมผสานอย่างลงตัว ให้เข้ากับรสนิยมของคนไทย ง่ายต่อการสวมใส่ และราคาที่สมเหตุสมผล แต่ไม่ละเลยรายละเอียดในการออกแบบ และการตัดเย็บ\r\n', '1452225763-IMG_2310.jpg', '160-162 โครงการ 4 ซอย 49/2', 3000, 3, '080 273 2507', 'Alaboratory alab', 'A laboratory3015', 'Alabroom', 'alaboratory.alab@gmail.com ', 'ไม่ระบุ', 'ไม่ระบุ', '1447341305-1.jpg', 590, 590, 'เสื้อผ้าร่วมสมัย, เสื้อผู้หญิงทำงาน, ลำลอง, unisex, โทนขาวดำ,  vintage jeans,', 1, 0, 13.799434, 100.5503616, 0, 'เสื้อผ้าร่วมสมัย เสื้อผู้หญิงทำงาน ลำลองและ unisex ภายใต้โทนขาวดำ รวมไปถึงสินค้า vintage jeans', 'เสื้อผ้าร่วมสมัย เสื้อผู้หญิงทำงาน ลำลองและ unisex ภายใต้โทนขาวดำ รวมไปถึงสินค้า vintage jeans', '2018-06-24 17:36:23'),
