(70, 30, 'Viva 26', 'ร้าน Viva นี่คงเหมือนกับผับกลางวันทั่วไป ตามห้างสรรพสินค้า อย่าเพิ่งด่วนสรุปเช่นนั้นนะครับ ถ้ายังไม่เคยไป เพราะ Viva ก็คือผับ ในอารมณ์ของจตุจักร ถ้าคุณคิดว่าจตุจักรแตกต่างตลาดนัดทั่วๆไปเพราะมี ความเป็นตัว ของตัวเอง Viva ก็เป็นเช่นนั้นแหละครับ ส่วนสนนราคานั้น อยู่ในระดับสบายกระเป๋ามีพก ติดตัวไม่เกิน 200 ก็ชื่นใจกับ Gin Tonic ได้เกิน 2 แก้วแล้วครับ\r\n\r\nจวบจนกระทั่งบินเดี่ยวนั่งจิบ Gin Tonic ระงับความร้อนขึ้นแก้วที่ 4 ไปแล้วเจ้ารุ่นน้อง ตัวแสบก็โผล่หน้าเข้าร้านมาพร้อมกับของพะรุงพะรัง ปากมันก็สั่งเด็กในร้านให้เอาเบียร์เย็นๆ มาหนึ่งขวด พอมันได้หย่อนก้นลงนั่งก็จับความกระแหนะกระแหนบินเดี่ยวในทันใด "อย่างพี่นี่อยู่ที่ไหนก็บินเดี่ยวหมดได้ใช่ไหมพี่ บ่ายๆ นี่พี่ยังบินได้เลยไม่ใช่เหรอ" บินเดี่ยวได้แต่พยักหน้าหงึกหงัก รับคำมันไป โธ่ระหว่าง ไปเดินเบียดผู้คนในอากาศร้อน อบอ้าวสู้นั่งจิบความเย็น จากก้อนน้ำแข็งผสม ว้อดก้า + น้ำมะนาว+ โทนิค มีกับแกล้มทาง สายตาเป็นสาวๆต่างชาติ อยู่ที่นี่ดีกว่า \r\nขอยืนยันเลยครับว่าชีวิตคุณดีขึ้นแน่นอน พอ Gin Tonic แก้วที่ 4 วาบผ่านลำคอ คุณไปแล้ว คุณก็จะคิดออกเองแล้วละว่า คืนนี้ตารางชีวิตสมควรไปตอกบัตรที่ใดดี\r\n\r\nhttp://www.oknation.net/blog/issue01/2008/01/26/entry-1', '1450459184-20151121_102109.jpg', '7 Lanes Down Between Soi 1 and 2 Section 26\r\nNo.159-161 / No.171-172', 1197, 3, '02-272-4783', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'viva.chatuchak@iname.com', 'ไม่ระบุ', 'ไม่ระบุ', '1450457597-20151121_102116.jpg', 200, 500, 'อาหาร, เครื่องดื่ม', 1, 0, 13.799434, 100.5503616, 0, '', '', NULL),
