(83, 30, 'Wantong', 'สาวๆที่ชอบทานของหวานๆ ต้องพลาดไม่ได้เลยกับร้าน wantong ร้านที่อยู่ในตลาดนัดจตุจักรนั่นเอง จะมาเป็นแก้งส์ หรือจะมากับแฟน ก็อร่อยได้ทั้งนั้น ร้านนี้มีเมนูของหวานให้เลือกหลากหลายเลยทีเดียว แต่บอกก่อนเลยว่ามาทานแล้วติดใจ ก็ออกกำลังกายกันด้วยล่ะสาวๆ\r\n\r\n"วันทอง คาเฟ่" อีกหนึ่งของดีประจำตลาดนัดจตุจักรที่ห้ามพลาด ร้านค่อนข้างเล็ก สีขาวแต่งด้วยต้นไม้ มาลัยไทยเพิ่มความสบายตา ทีเด็ดต้องยกให้กับขนมเค้กสไตล์ไทย ไม่ว่าจะเป็นทาร์ตขยาที่นำทาร์ตมาฟีเจอร์ริ่งกับสังขยา, Nilla เค้กข้าวไรซ์เบอร์รี่ผสมมะพร้าวอ่อน อร่อยละลาย และ Almond Lemon เค้กไร้แป้งเนื้อเบาอร่อยกำลังดี ', '1450363698-20151121_103500.jpg', 'ตลาดนัดจตุจักร โครงการ 26 ซอย 1/4', 617, 3, '088 885 7751', 'wantongcafe', 'WantongCafe', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', '1450363710-20151121_103546.jpg', 50, 200, 'เครื่องดื่ม, กาแฟ', 1, 0, 13.799434, 100.5503616, 0, 'Girls who like to eat sweets. Do not miss the shop wantong shop at Chatuchak weekend market in itself. Will the gang Or come up with boyfriend It was delicious, too This shop offers a wide selection of desserts ever. I tell you that I love to eat. I workout with my girls.\r\n\r\n"Gold Cafe" One of the great annual Weekend Market, a must. A relatively small White dress with tree Garland Thailand increased comfort What to give the cake with Thailand. Whether the drug is taken tart tart with custard bearing the features, Nilla rice cakes Rice mixed berries and coconut delicious melted Almond Lemon cake without flour, light texture, taste good.', '女孩誰喜歡吃甜食。千萬不要錯過札都甲週末市場店萬通店本身。請問團伙或拿出男友它是好吃，太這家商店提供的甜點有史以來的廣泛選擇。我告訴你，我喜歡吃。我鍛煉我的女孩。\r\n\r\n“黃金咖啡”一個偉大的週末每年市場，必須的。相對較小白裙樹加蘭泰國提高舒適度什麼給泰國的蛋糕。該藥物是否採取撻撻蛋奶承載功能，Nilla年糕水稻混合漿果和椰子的美味融化杏仁檸檬蛋糕沒有麵粉，質地輕，口感好。', NULL),
