(86, 21, '9 Thong Pan Pee', ' รับทำป้ายโดยใช้ไม้เป็นวัตถุดิบหลัก มีทั้งไม้สัก ไม้่สน ไม้มะเกลือ ไม้มะค่า ไม้อัด MDF รับสั่งทำตามที่ลูกค้าต้องการ \r\n        และนำงานเรซิ่น เช่น ดอกไม้ เรซิ่น สุนัขเรซิ่น ตุ๊กตาเรซิ่น ฯลฯ มาตกแต่งป้ายเพื่อเพิ่มความ สวยงามให้กับชิ้นงาน\r\n\r\n                ประเภทงานของเราอาทิเช่น ป้ายเลขที่บ้าน ป้ายชื่อร้าน ป้าย เบอร์ห้องตาม โรงแรม หอพัก และ อพาร์ทเม้นท\r\n        พวงกุญแจ ซึ่งลูกค้าจะสามารถออกแบบ ได้ตามความต้องการและเรายังมีป้ายสำหรับตกแต่งห้อง ตกแต่งบ้าน เช่น\r\n        ป้ายห้องน้ำ ห้องนอน และ ป้ายคำมงคลต่าง ๆเพื่อเพิ่มสีสันให้กับบ้านท่าน \r\n\r\n                สำหรับลักษณะงานของเรานั้นมีทั้งการแกะสลักลงบนไม้และการนำตัวอักษรฉลุติดลงบนป้าย ทางเราขอรับรองว่าลูกค้าทุกท่าน\r\n        จะต้องพอใจกับชิ้นงาน ของเรา เพราะทางร้านของเราได้ดำเนินการมากว่า 5 ปี ซึ่งได้ผลิตชิ้นงาน มาแล้วมากมาย \r\n        โดยทางเราจะเน้นที่คุณภาพและความพอใจของลูกค้าเป็นสำคัญ ', '1450462342-20151121_095941.jpg', '- Jatujak sec 4 no.121\r\n- Jatujak sec 20 no. 5/7\r\n- Jatujak sec 24 no.7', 3553, 2, '081 407 3736', 'ไม่ระบุ', 'ไม่ระบุ', 'tongpanpee', 'tongpanpee@hotmail.com', 'ไม่ระบุ', 'www.tongpanpee.com', '1450462356-20151121_095941.jpg', 50, 500, 'ป้ายไม้, ฉลุ, แกะสลัก, จำหน่ายป้ายสำเร็จรูป, ไม้สัก, เรซิ่น, ตัวอักษรต่างๆ,ของตกแต่งบ้าน', 0, 0, 13.799434, 100.5503616, 0, ' รับทำป้ายโดยใช้ไม้เป็นวัตถุดิบหลัก มีทั้งไม้สัก ไม้่สน ไม้มะเกลือ ไม้มะค่า ไม้อัด MDF รับสั่งทำตามที่ลูกค้าต้องการ \r\n        และนำงานเรซิ่น เช่น ดอกไม้ เรซิ่น สุนัขเรซิ่น ตุ๊กตาเรซิ่น ฯลฯ มาตกแต่งป้ายเพื่อเพิ่มความ สวยงามให้กับชิ้นงาน\r\n\r\n                ประเภทงานของเราอาทิเช่น ป้ายเลขที่บ้าน ป้ายชื่อร้าน ป้าย เบอร์ห้องตาม โรงแรม หอพัก และ อพาร์ทเม้นท\r\n        พวงกุญแจ ซึ่งลูกค้าจะสามารถออกแบบ ได้ตามความต้องการและเรายังมีป้ายสำหรับตกแต่งห้อง ตกแต่งบ้าน เช่น\r\n        ป้ายห้องน้ำ ห้องนอน และ ป้ายคำมงคลต่าง ๆเพื่อเพิ่มสีสันให้กับบ้านท่าน \r\n\r\n                สำหรับลักษณะงานของเรานั้นมีทั้งการแกะสลักลงบนไม้และการนำตัวอักษรฉลุติดลงบนป้าย ทางเราขอรับรองว่าลูกค้าทุกท่าน\r\n        จะต้อง