(92, 18, 'CHARKA DESIGN', 'Charka Design ขอนำเสนอคอลเลคชั่น Art & Printing ด้วยการออกแบบลายแนว Street style ใส่ง่าย เหมาะกับทุกโอกาส พร้อมด้วยเทคนิคการพิมพ์ภาพ Digital Printing ที่สามารถพิมพ์ภาพเหมือนลงบนเสื้อได้อย่างสวยงาม และผิวสัมผัสเนียนไปกับเสื้อ ใส่สบาย ไม่ร้อน\r\nเนื้อผ้า Cotton 100% ใน size M,L,XL แต่ละลายจัดจำหน่ายในสีขาวและเทาท๊อปเข้ม\r\nThe special limited collection of this month "Charka Design & Art Printing" is now landing on our Charka Design store. The outstanding design blends with special printing technique makes it differentiated from another collection.', '1450748854-IMG_1874.jpg', 'ตลาดนัดจตุจักร โครงการ 10 ซอย 20 (ถนนคนเดิน) ', 1466, 3, '085-166-5276 / 086-001-2965', 'CHARKADESIGN', 'ไม่ระบุ', 'ไม่ระบุ', 'charkaorder@gmail.com', 'ไม่ระบุ', 'WWW.CHARKADESIGN.COM', '1450748912-IMG_1870.jpg', 100, 100, 'T-Shirt Made to Order เสือรับน้อง เสื้อทีม เสื้อชมรม เสื้อกิจกรรมต่างๆ', 1, 0, 13.799434, 100.5503616, 0, 'T-Shirt Made to Order\r\nเสือรับน้อง เสื้อทีม เสื้อชมรม เสื้อกิจกรรมต่างๆ\r\n', 'T-Shirt Made to Order\r\nเสือรับน้อง เสื้อทีม เสื้อชมรม เสื้อกิจกรรมต่างๆ\r\n', NULL),
