(97, 30, 'viva 8', 'Viva 8 is your place at JJ Market for good music and great drinks and fabulous fun. Viva 8 เป็น Full Bar คือเป็นบาร์ที่ครบเครื่อง จ่ายเงินก่อนสั่งเหมือนเปย่า ความเชี่ยวชาญของบาร์เทนเดอร์มีสูงฝีมือดี ใส่ส่วนผสมแบบ "ไม่งก" ไม่เหมือนบางร้านหรูใจกลางกรุงที่นอกจากจะแพงแล้ว ดื่มเข้าไปนึกว่าสั่งน้ำหวานน้ำเปล่า \r\n\r\nเมื่ออาหารเป็นเปย่า ผมเลยขอลอง "แซงเกรีย" (Sangria) เครื่องดื่มประจำชาติสเปนและโปรตุเกส เป็นน้ำผลไม้ผสมไวน์แดงและบรั่นดี ใส่น้ำแข็งเย็นๆ ทานแล้วชื่นใจ แต่ขอเตือนว่าหากมาทานช่วงเที่ยงอย่างผม ต้องพร้อมเจอแดดจ้า เว้นแต่ว่าจะนั่งมึนจนยันค่ำ!!\r\n\r\nก่อนจากมาคุณเอ๋รีบเปิดให้ฟังอีกเพลง "Come Together" เจ้าตำรับของ The Beatles ที่เอามาเรียบเรียงใหม่ ครึกครื้นกันทั้งร้าน "อาหารอร่อย ดนตรีไพเราะ" โดยไม่มีการประท้วงครับพี่น้อง!! http://www.matichon.co.th/news_detail.php?newsid=1415412037', '1450796339-IMG_1934.jpg', 'Section 8', 1299, 4, '02 618 7425 / 085 072 5558', 'viva8', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'https://www.wongnai.com/restaurants/163244lx-viva-8-bar/reviews', '1450796389-IMG_1921.jpg', 100, 300, 'Viva 8 is your place at JJ Market for good music and great drinks and fabulous fun', 1, 0, 13.799434, 100.5503616, 0, 'Viva 8 is your place at JJ Market for good music and great drinks and fabulous fun', 'Viva 8 is your place at JJ Market for good music and great drinks and fabulous fun', NULL),
