(112, 23, 'HALO CRAFT', 'aromatic candle, reed diffuser, essential oil, spa products แบรนด์ ฮาโล คราฟท์ เริ่มเมื่อ พ.ศ.2547 โดยเรื่มจากการผลิตเทียนหอมเป็นหลัก ด้วยวัตถุดิบที่ได้คัดสรรมาเป็นอย่างดี และ เทคนิคความชำนาญที่มีการพัฒนามาอย่างต่อเนื่องทำให้เทียนของเรามีรูปลักษณ์ที่สวยงามแปลกตา มีคุณภาพที่ได้รับการยอมรับจากลูกค้าเป็นอย่างดี ไม่เพียงแต่มีความเหมาะสมในการวางประดับตกแต่งเท่านั้น แต่ยังสามารถใช้งานดีได้มาตรฐานสากล\r\n\r\nผลิตภัณฑ์เครื่องหอมของฮาโล คราฟท์เริ่มมีความหลากหลายมากยิ่งขึ้น เช่น น้ำมันหอมระเหย,เครื่องหอมปรับอากาศ, reed diffuser เป็นต้น เีีพียงระยะเวลาไม่นานนัก ด้วยคุณภาพและรูปลักษณ์การออกแบบที่โดดเด่น ก็ทำให้แบรนด์ ฮาโล คราฟท์ ได้รับการยอมรับไม่เพียงแต่ลูกค้าในประเทศเท่านั้น แต่ยังเป็นที่สนใจของลูกค้าต่างชาติเป็นอย่างมาก\r\n\r\nและเมื่อปี พ.ศ. 2553 ร้าน ฮาโล คราฟท์ สาขาสวนจตุจักร ได้เปิดบริการเพื่อสนองความต้องการอีกระดับของความหอมที่น่าหลงใหล ด้วยผลิตภัณฑ์เครื่องหอมที่ได้คุณภาพในราคาที่สมเหตุสมผล Aromatic Candle, Reed Diffuser, Aromatic Oil, Massage Candle, Massage Oil, Oil Burner, Aromatic Sachet, Air Freshener', '1450972104-20151121_132716.jpg', 'ตลาดจตุจักร โครงการ 11 ซอย 12/1 เลขที่.017-018, โครงการ 23 ซอย 31/4 เลขที่.275-276', 2531, 3, '02 294 3194 / 081 809 8294 / 086 374 3083', 'halocraft', 'halo craft aromatic', 'halocraft', 'halocraft@hotmail.com', 'ไม่ระบุ', 'www.halocraft.net', '1450972168-20151121_132727.jpg', 100, 1000, 'aromatic candle, reed diffuser, essential oil, spa products, น้ำหอม,', 0, 0, 13.799434, 100.5503616, 0, 'aromatic candle, reed diffuser, essential oil, spa products brand, Kraft began on Halloween 2547 at the start of a major manufacturing candles. With the selection of raw materials as well, and technical expertise that has developed continuously make our candles look quaint. Quality has been recognized by customers as well. Not only has the right to place the decorations only. It also works well with international standards.\r\n\r\nLuxury .... Natural ....Fascinating .... Aromatic....\r\nHALO CRAFT\r\n\r\nSince the year 2004, Halo Craft has stepped into the realm of the aromatic. We started from aromatic handmade candles. With the finest materials and high-skilled techniques, Halo Craft\'s candle creats unique & eye-catching designs. \r\nOur catagory gradually expand to other home fragrance products (essential oil, perfume sachet, diffuser)\r\nNot so long after, because of the high quality and fascinating package designs, we were well known not only by Thai customers but also many foreign importers.\r\nNow you can discover another level of aromatic moment from Halo Craft\'s shop at Jatujak Weekend Market. It was opened in the year 2009 to serve all customers with the high quality and reasonable price aromatic products.', '芳香蠟燭，蘆葦擴散，揮發油，水療產品品牌，卡夫在主要製造蠟燭的起點開始在萬聖節2547。隨著原材料的選擇以及和專業技術已經不斷發展使我們的蠟燭看起來古色古香。質量得到了客戶的認可，以及。不僅具有僅放置裝飾的權利。它還與國際接軌效果很好。', NULL),
