(115, 19, 'Paint my shoe', 'ไม่ว่าใครเดินผ่านร้านนี้ ย่อมอดใจไม่ได้ที่จะต้องหยุดชมครับ ร้าน Paint my shoe สามารถสะกดผู้ที่ผ่านมาได้อย่างง่ายดาย เพราะ รองเท้าแต่ล่ะคู่ช่างดูน่าจับจองเป็นเจ้าของหรือเกิน มีตั้งแต่ลายการตูนน่ารักๆ ไปจนถึงลายไทยที่มากด้วยรายละเอียดจนไม่อาจละสายตาได้ ได้รับความสนใจอย่างมากทั้งคนไทยและต่างชาติ บางคนถึงขนาดยอมยืนรอหลายๆชั่วโมงเพื่อจะได้รองเท้า Handmade ที่มีเพียงคู่เดียวของร้านนี้ กลับประเทศบ้านเกิดไปด้วย\r\n\r\nร้านนี้เค้ารับเพ้นรองเท้า ทุกแบบ ทุกแนว เพิ่มเอกลัษณ์ให้รองเท้าของคุณให้ไม่เหมือนใคร', '1452412529-DSC_0344.jpg', 'โครงการ 7 ซอย 7', 1523, 4, '085 485 9996', 'https://www.facebook.com/paintmyshoe', 'ไม่ระบุ', 'paintmyshoe', 'paintmyshoe9@gmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1452412529-DSC_0342.jpg', 600, 600, 'art fashion รองเท้า', 1, 0, 13.799434, 100.5503616, 0, ' " Unique is Simple "\r\n\r\nWho ever walked pass this shop, won\'t be able to resist not to look inside this amazing shop. All of their collection is stunning by the wonderful artwork, remarkable detail and fascinating color.  Artworks are variety from simple cartoon drawing to high detail of Thai style art. Shoes from this shop is one of a kind because every piece is handmade so you have to be very lucky to find one pair that match both style and size of your feet.  Custom made is one the service that this shop provide, so you can think of any thing you want and they will turn it into reality for you.', ' " Unique is Simple "\r\n\r\nWho ever walked pass this shop, won\'t be able to resist not to look inside this amazing shop. All of their collection is stunning by the wonderful artwork, remarkable detail and fascinating color.  Artworks are variety from simple cartoon drawing to high detail of Thai style art. Shoes from this shop is one of a kind because every piece is handmade so you have to be very lucky to find one pair that match both style and size of your feet.  Custom made is one the service t', NULL),
(116, 24, '46Area Art', '46 Area Art เป็นร้านเครื่องปั้นเซรามิคเล็กๆสุดชิค อยู่ในจตุจัตรโซน 7 ร้าน นอกจากมีสินค้าเซรามิคแนวๆขายแล้วยังรับสอนเซรามิก สอนภาพพิมพ์ สอนเค้กโฮมเมด เป็นทั้ง Art studio และรับทำWorkshop event แบ่งเวลาให้ตัวเองได้สุขแบบชิลๆ มาทำงานศิลปะแบบไม่ต้องเครียด ได้ผลงาน ได้เพื่อน ได้รู้ ได้ประสบการณ์ใหม่ มีแต่ได้นะคะ เทียบ เงินที่จ่ายไปกับการมาworkshopนั้น คุ้มยิ่งกว่าคุ้มค่ะ  ไม่เจาะจงว่าต้องมาที่นี่ ที่ไหนๆ ศิลปะก็สร้างความสุขให้ทุกคนเสมอค่ะ', '1452413339-DSC_0403.jpg', 'ตลาดนัดจตุจักร โครงการ 7', 1133, 3, '086 984 4119', '46areaart', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', '1452413339-DSC_0419.jpg', 200, 3000, 'เซรามิค งานปั้น art ', 1, 0, 13.799434, 100.5503616, 0, '', '', NULL),
(117, 24, '@rtlover Gallery ', 'Art Gallery ที่รวมรวมผลงานศิลปิน Narate Kathong ในแนว Pointillism และ impressionism ไว้มากมาย \r\nซึ่งผลงานได้รับแรงบันดาลใจมาจาก Georges Seurat and Claude Monet.\r\nแนวที่ถนัดคือ Contemporary arts และ acrylic painting\r\n', '1452414960-DSC_0092.jpg', 'Number 63/1 Section 7 Soi 1', 2317, 3, '0815116839', 'narate kathong', 'ไม่ระบุ', 'ไม่ระบุ', 'noterate@gmail.com', 'ไม่ระบุ', 'http://www.artlovergallery.com/', '1452414960-DSC_0096.jpg', 5000, 5000, 'art ภาพวาด ภาพสีน้ำมัน', 0, 0, 13.799434, 100.5503616, 0, 'Art Gallery ที่รวมรวมผลงานของศิลปินไว้มากมาย', 'Art Gallery ที่รวมรวมผลงานของศิลปินไว้มากมาย', NULL),
(118, 24, 'gallary beyond', 'ร้านขายงานศิลปะ ทั้งปะติมากรรมงานศิลป์ และภาพวาดต่างๆ ร้านนี้สายอาร์ตต้องชอบแน่นอน ร้านมีสไตล์ที่แแตกต่าง และมีเอกลักษณ์ในงานที่เป็นของตัวเองไม่เหมือนใครจริงๆ และต้องทำความเข้าใจอย่างลึกซึ้งจริงๆ บอกเลยว่าสายอาร์ตห้ามพลาด', '1452415872-DSC_0042.jpg', 'ตลาดนัดจตุจักร โครงการ 7 ซอย 1', 1046, 4, '089 452 3317', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'paul.de.blieck.12@gmail.com', 'ไม่ระบุ', 'www.picasaweb.google.com/paul.de.blieck', '1452415872-DSC_0037.jpg', 2000, 2000, 'art sculpture ', 0, 0, 13.799434, 100.5503616, 0, 'Paul De Blieck\r\nBorn    :(1961) in Brugge, Belgium,\r\nis a self taught artist. Since 1987 he has been living in Asia, mainly in Thailand. Paul loves painting as it gives him the opportunity to experiment with colors and to create all kind of styles. When he paints he usually doesn’t plan exactly what he wants to paint. He lets his imagination wander and just sees where it leads him.\r\nPaul De Blieck is an up and coming artist. His compositions reveal much imagination with explosions of colors that draws the viewer to focus their attention on his exciting pieces of work.', '', NULL),
(119, 24, 'Kongsak', 'Mr. Kongsak art gallery เป็นร้านที่รวบรวมรูปภาพงานศิลปะไว้อย่างหลากหลาย ทั้งภาพวาดสีน้ำ สีน้ำมัน \r\n\r\nจากงานเพนท์เปลี่ยนเป็นปั้นเเละเปลี่ยนเป็นสิ่งของเเละเเล้วก้อเข้ามาอยู่ในชีวิต', '1452416731-DSC_0011.jpg', 'Section 7 Soi 1', 1390, 3, '086 998 8337', 'KPDrop', 'ไม่ระบุ', 'ไม่ระบุ', 'tykrub@hotmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1452416731-DSC_0014.jpg', 2000, 2000, 'Art งานศิลป์', 0, 0, 13.799434, 100.5503616, 0, 'Mr. Kongsak art gallery ', 'Mr. Kongsak art gallery ', NULL),
(120, 24, 'Woodlee', '100% Hand-cut มีทั้ง Woodcut Block Print Art  Textiles งานแกะสลักไม้ กรอบรูปดอกไม้ประดิษฐ์ และรูปวาดที่มีเอกลักษณ์เฉพาะตัวไม่เหมือนใคร สามารถนำไปตั้งโชว์สวยงามที่บ้าน หรือที่ออฟฟิศก็ได้ ถ้าใครชื่นชอบเป็นพิเศษก็สามารถสะสมเก็บไว้ดูเล่นในวันสบายๆก็ดี', '1452418848-DSC_0201.jpg', 'Section 7 Soi 3', 1389, 3, '086 803 2258', 'woodlee', 'woodlee008', 'woodlee008', 'woodlee008@gmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1452418848-DSC_0210.jpg', 50, 50, 'wood cut art ', 0, 0, 13.799434, 100.5503616, 0, '100% Hand-cut Woodcut Block Print Art and Textiles', '100% Hand-cut Woodcut Block Print Art and Textiles', NULL),
(122, 19, 'Vanichet', 'เรา ทำหนังด้วยมือ หนังแท้ของ วัว จระเข้ Stringray , Python ผลิตภัณฑ์ของเราเป็นกระเป๋า , โซ่ห้อยกระเป๋า ฮาร์เลย์ ที่นั่ง , เข็มขัด และ เก้าอี้ "มัน เป็นการต่อสู้ ที่แท้จริง ที่ทุกอย่างเริ่มจากฝุ่น" จำ พิเชษฐ์ วานิช เจ้าของร้าน 42 ปีของ หัตถกรรม วานิช เริ่มจากร้านขนาดเล็ก สินค้ากระเป๋าหนัง และกระเป๋าสตางค์ แรงบันดาลใจจาก นักขี่จักรยาน , โลหะหนัก , คาวบอย และอเมริกา แฟชั่น อินเดีย ของปี 1970', '1458789195-67452_806451522816766_1204882044837078577_n.jpg', 'ตลาดจตุจักร โครงการ 7 ประตู 2 ซอย1', 2590, 5, '089 477 4933', 'Handicraftvanich', 'ไม่ระบุ', 'turbo-chang', 'chang.vkk@gmail.com', 'ไม่ระบุ', 'www.handicraftvanich.com', '1458789180-1382935_809366582525260_5478936927225798948_n.jpg', 100, 5000, 'เครื่องหนัง', 1, 1, 13.799434, 100.5503616, 0, 'We are selling hand made genuine Leather of Cow, Crocodile, Stringray, Python. Our product is Hand Bag, Wallet, Wallet Chain, Harley Seat, Belt and Chair\r\n\r\n\'It was a real struggle, like making money from dust," recalls Pichet Vanich, the 42-year-old owner of Handicraft Vanich Manufacturing, a small enterprise that makes leather bags and wallets inspired by the biker, heavy metal, cowboy and American Indian fads of the 1970s.', '我們是賣手工製作的牛，鱷魚，Stringray，巨蟒的真皮。我們的產品是手包，錢包，錢包鏈，哈雷座椅，帶和椅子。\r\n\r\n“這是一個真正的鬥爭，就像從塵土賺錢，”回憶Pichet Vanich，工藝品Vanich製造業，小企業，使皮包和錢包由騎自行車，重金屬，牛仔和美國啟發的42歲的主人。上世紀70年代印度的潮流。', NULL),
