(127, 23, 'ARB-IMS Products by yahma', 'จำหน่ายสินค้า Home spa สบู่ออแกนิค\r\nทำอย่างไรถึงจะ ARBIMS\r\nในปี 1993 ภายใต้ บริษัท ชื่อ "ที Standi จำกัด "\r\nเราทำงานในอุตสาหกรรมการออกแบบสิ่งพิมพ์ ธุรกิจของเราคือการให้บริการที่มีการออกแบบผลิตภัณฑ์สำหรับการเผยแพร่\r\nโดยเฉพาะอย่างยิ่งในปฏิทินหรือ publications.Until ทั่วไปปี 2002 ที่มีประสบการณ์ที่ยาวนานของเราและความรู้มืออาชีพ\r\nในอุตสาหกรรมนี้และมีความน่าสนใจของสมุนไพรไทยต่อมาเราใช้พวกเขาและเริ่มที่จะสร้าง\r\nผลิตภัณฑ์โดยใช้วัสดุธรรมชาติเป็นส่วนผสมตั้งแต่ปี 2003 ที่จุดเริ่มต้น\r\nเราผลิตเพียงสบู่ธรรมชาติที่ทำจากน้ำมันพืชและหลังจากนั้นความหลากหลายของผลิตภัณฑ์ที่ถูกพัฒนาขึ้นเช่น\r\nบาร์สบู่ธรรมชาติในรูปทรงที่แตกต่างกัน, บาร์สบู่ glyderin กับรังบวบ, เกลืออาบน้ำ, ฝักบัวเกลือขัด\r\nโลชั่นบำรุงผิว, แชมพูสมุนไพร, ครีมสมุนไพร, เจลอาบน้ำและอื่น ๆ\r\nวันนี้เรามีผลิตภัณฑ์ "ARB-IMS" และทำให้การสั่งซื้อสินค้า\r\nเพื่อประทับตราด้วยชื่อแบรนด์ของคุณเอง นอกจากนี้เรายังให้บริการบรรจุภัณฑ์ของผลิตภัณฑ์ของเรา\r\nรวมทั้งบรรจุภัณฑ์และการออกแบบตราสินค้าสำหรับลูกค้าของเรา', '1454987684-IMG_4475.jpg', 'ตลาดนัดจตุจักร โครงการ 8  ซอย17/1 เลขที่ 247-248', 2315, 4, '091 135 753, 090 909 2140', 'arbimsproducts', 'ไม่ระบุ', 'ไม่ระบุ', 'exportabims@gmail.com, exportarbims@hotmail.com, arbimsoap@gmail.com', 'ไม่ระบุ', 'www.arbims.com', '1454987684-950.jpg', 100, 1000, 'spa', 0, 0, 13.799434, 100.5503616, 0, ' How to be ARBIMS\r\nIn 1993 under the company named “Locus Standi Co., Ltd.” \r\nwe worked in publishing design industry. Our business was to provide a designing service for publishing products, \r\nparticularly calendar or general publications.Until 2002 with our long experience and professional knowledge \r\nin this industry and with the interesting of the Thai herb, later we applied them and started to create \r\nthe products by using natural materials as an ingredient since 2003. At the beginning \r\nwe produced only a natural soap made from vegetable oil and after that a variety of products were developed such as \r\na natural soap bar in a different shape, glyderin soap bar with loofah, bath salt, shower salt scrub, \r\nbody lotion, herbal shampoo, herbal conditioner, shower gel and so on.\r\nToday we provide the products “ARB-IMS” and make to order products \r\nto stamp with your own brand name. We also provide the packaging services of our products \r\nincluding packaging and brand design for our customer.', '如何成為ARBIMS\r\n1993年公司名稱為“洛可斯實業有限公司”\r\n我們在出版設計業工作。我們的業務是為出版產品提供設計服務，\r\n特別是日曆或一般出版物。2002年以我們長期的經驗和專業知識\r\n在這個行業和有趣的泰國草藥，後來我們應用他們，並開始創造\r\n該產品以自然材料為原料，自2003年開始\r\n我們只生產由植物油製成的天然肥皂，之後開發了各種產品\r\n不同形狀的天然皂條，用絲瓜，沐浴鹽，淋浴鹽擦洗的glyderin皂條，\r\n身體乳液，草本洗髮水，草藥調理劑，沐浴露等。\r\n今天我們提供產品“ARB-IMS”，並訂購產品\r\n以自己的品牌名稱。我們還提供我們的產品的包裝服務\r\n包括為我們的客戶提供包裝和品牌設計。', NULL),
(128, 23, 'MONTRA SENSE', 'มนตราความรู้สึกที่ได้รับการจัดตั้งขึ้นตั้งแต่ปี 2000 ในตลาดนัดสวนจตุจักร. เริ่มต้นที่มีเพียงร้านค้าขนาดเล็ก (5 ตารางเมตร) แบรนด์ที่มีตอนนี้กลายเป็นที่ประสบความสำเร็จอย่างมากกับ 6 ร้านค้าในจตุจักรมีแผนจะขยายผลิตภัณฑ์ของเราในต่างประเทศ\r\n\r\nภารกิจของเราคือการสร้างกลิ่นหอมใหม่ที่ลูกค้าต่างประเทศของเราจะรัก. เราคาดการณ์ว่าหลังจาก 5 ปีข้างหน้ามนตราผลิตภัณฑ์ความรู้สึกจะเป็นตัวแทนในหลายประเทศทั่วโลก\r\n\r\nเรามีผลิตภัณฑ์มากมายสำหรับบ้านหรูที่อยู่อาศัยเช่นเป็นเตาน้ำมันหอม, เทียน, diffusers 100 และกลิ่นหอมที่แตกต่างกันในสิ่งอื่น ๆ', '1454988500-IMG_4489.jpg', 'ตลาดจตุจักร section9 ซอย 13/7 เลขที่ 237-238, section9 ซอย 13/8 เลขที่ 247-248', 1740, 5, '086 626 8998, 038 825 118', 'montrasense', 'ไม่ระบุ', ' @montrasense', 'montrasense@hotmail.com', 'ไม่ระบุ', 'www.montrasense.com', '1454988500-950.jpg', 100, 1000, 'น้ำหอมอโรม่า', 0, 0, 13.799434, 100.5503616, 0, 'Montra Sense has been established since the year 2000 in Jatujak weekend Market. Starting with just a small shop (5 sqm), the brand has now become very successful with 6 shops in Jatujak with plans to expand our product overseas.\r\n\r\nOur mission is to create new fragrances that our international customers will love. We predict that after the next 5 years Montra Sense products will be represented in many countries around the world.\r\n\r\nWe have many products for luxury home living such as as oil burners, candles, diffusers, and over 100 different fragrances among other things.', '自2000年以來在乍都乍週末市場曼達感已經建立。只是一個小商店（5平方米）開始，這個品牌現在已經成為在乍都乍6商店，並計劃向海外拓展我們的產品非常成功。\r\n\r\n我們的使命是創造新的香水，我們的國際客戶會喜歡。我們預測，未來5年後曼達感的產品將在世界各地的許多國家表示。', NULL),
(129, 21, 'Dharamantra', 'เทียนหอม น้ำหอมอโรม่า We welcome you to the sense of smell that you get a sense of exotic perfumes are different than you could ever experience. Because we have chosen a quality fragrances from around the world. And includes a fragrance that is unique to the Thai mix-Legit sme', '1454989144-IMG_4501.jpg', 'section 8 ซอย 17/3 เลขที่ 203-204', 1147, 3, '086 356 5459', 'DharamantraAromaoil', 'DharamantraAromaoil', ' Dharamantraaromaoil', 'dharamantra.8@hotmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1454989144-950.jpg', 100, 1000, 'เทียนหอม', 0, 0, 13.799434, 100.5503616, 0, 'เทียนหอม น้ำหอมอโรม่า', 'เทียนหอม น้ำหอมอโรม่า', NULL),
