(133, 21, 'Pipe Works', 'ใครที่ชอบความมีเอกลักษณ์และไม่เหมือนใครห้ามพลาดร้านนี้โดนเด็ดขาดครับ ร้านสุดแนวที่สรรค์สร้างงานขึ้นมาจาก Pipe ครับ ใครจะไปคิดว่า ท่อPipe เอาไปทำอะไรได้มากกว่า Function ปกติของมัน แต่ pipe work ก้าวผ่านความธรรมดานั้นไปครับ \r\n\r\nเจ้าของร้านร้านนี้ไม่ใช่คนไทยครับ แต่ใครเจอรับรองตกใจนึกว่าลูกครึ่งแน่นอน พูดไทยชัดเหลือเกิน แถม friendly แบบสุดๆ เไม่ซื้อไม่ว่า มาแลกเปลี่ยนไอเดียและมาชมศิลปะก็ถือว่าคุ้มแล้วครับ แล้วถ้าจะอุดหนุดสินค้าเจ๋ง ที่ไม่มีที่ไหนเหมือนไปซักชิ้น ก็ถือว่ากำไรครับได้สินค้าแนวๆแถมมิตรภาพดีๆกลับไปด้วย \r\n\r\nร้านนี้มีสินค้าหลักเป็น โคมไฟที่ทำจาก Pipe และ USB ที่ทำจาก pipe เช่นกัน เรียกว่าได้อารมณ์แนว Industrial แบบสุดๆไปเลย นอกจากนี้ทางร้านก็ยังรับทำ Furniture Custom Made จาก Pipe อีกด้วยน่ะครับ ไม่ว่าจะเป็น โต๊ะ เก้าอี้ หรือชั้นวางของ ก็ทำได้ทุกอย่างตามแต่สั่งได้เลยครับ\r\n\r\nPipe Works started out of a genuine passion for crazy, out of the box ideas for everyday furniture. We\'ve been building pipe tables, shelving units, benches and custom sinks for over 4 years now. We are the first company to integrate USB charging devices directly into cast pipe fittings. This allows our chargers and lamps to uniquely blend from rugged cast steel, to an every day electronic device. Either on your desk at work, in the living ROOM on display, or on the bedside table, Pipe Works USB chargers and integrated USB lamps are always right where you need them most.', '1485926437-14884642_1369420193098751_6086319590386303649_o.jpg', 'ตลาดนัดจตุจักร โครงการ 7 ซอย 5', 899, 3, '087 972 1658', 'pipeworksdesign', 'FK-PIPEWORKS-DESIGN', 'ไม่ระบุ', 'paddy@pipeworksdesign.com ,Kunkel.Felix@web.de', 'ไม่ระบุ', 'www.pipeworksdesign.com', '1455078232-950.jpg', 100, 1000, 'ของตกแต่งบ้าน', 0, 0, 13.799434, 100.5503616, 0, 'I like the unique and like no, do not miss this store, I am ambivalent. Most shops along the creation of more jobs Pipe pipe Pipe think anyone is going to want to do more of it, but Function regular pace through the pipe work to the common good.\r\n\r\nThe owner of this shop is not just Thailand. But I have accepted that I was indeed a bastard. Thailand\'s exceedingly clear but extremely friendly Ea did not buy that. To exchange ideas and art, it is worth it. If the product is chewy fillings cool. There\'s nothing like the piece. It is not a profitable product line so it\'s good to be back.\r\n\r\nThis is a major product Lamps made of Pipe and USB made of pipe as well as the emotional landscape Industrial ultimate go this way, it has been done Furniture Custom Made From Pipe with me, be it a chair or the floor. Shelves Everything was done according to order it.\r\n\r\nPipe Works started out of a genuine passion for crazy, out of the box ideas for everyday furniture. We\'ve been building pipe tables, shelving units, benches and custom sinks for over 4 years now. We are the first company to integrate USB charging devices directly into cast pipe fittings. This allows our chargers and lamps to uniquely blend from rugged cast steel, to an every day electronic device. Either on your desk at work, in the living ROOM on display, or on the bedside table, Pipe Works USB chargers and integrated USB lamps are always right where you need them most.', '我喜歡獨特的，就像沒有，千萬不要錯過這家店，我很矛盾。沿著創造更多的就業機會管道管材管大多數商店認為任何人會希望做更多的，但功能常規的速度通過管道工作的共同利益。\r\n\r\n這家店的老闆是不只是泰國。但我已經接受了我確實是個混蛋。泰國的非常清楚，但非常友好的Ea沒買。交流思想和藝術，這是值得的。如果產品有嚼勁餡料冷卻。有沒有像一塊。它不是一個賺錢的產品線，因此是很好的了。\r\n\r\n這是一個重大的產品取得管道和USB的燈製成管，以及情緒的風景工業最終走上這條路，它已經完成家具定制從我管的，無論是椅子或地板上。貨架一切都按順序完成它。\r\n\r\n管道工程開始了真正的激情為瘋狂，開箱即用的思想日常家具。我們已經建立管表，現在擱架單元，長椅和自定義接收超過4年。我們是USB充電的設備直接集成到投管件的第一家公司。這使我們的充電器和燈具從堅固的鑄鋼獨特融合，到每天的電子設備。無論是在工作你的辦公桌，在展出的客廳，還是放在床頭櫃上，管道工程USB充電器和集成的USB燈永遠是對的，你最需要它們。', NULL),
(134, 24, 'pariwat', 'ภาพกราฟฟิก งานศิลป์สวยงามสไตล์กราฟฟิก โมเดิ้น ใครที่ชอบงานศิลป์แนวนี้ ต้องไม่พลาดที่จะไปดูร้านนี้เลย งานศิลป์ที่ออกแบบมาล้วนแต่มีความปราณีตใส่ใจในรายละเอียด ทั้งการตัดต่อภาพต่างๆ ที่เป็นคนละภาพ คนละแบบ สามารถนำมารวมกันให้อยู่บนภาพเดียวกันได้ ดูแล้วกลมกลืนกันเหมือนเป็นแนวเดียวกันเลย', '1455078686-DSC_0192.jpg', 'ตลาดนัดจตุจักร โครงการ 7 ซอย 3 เลขที่ 118', 1230, 3, '089 135 8099', 'pariwatstudio', 'ไม่ระบุ', 'ไม่ระบุ', 'big.pariwat@gmail.com', 'ไม่ระบุ', 'http://a-pariwat.blogspot.com', '1455078686-950.jpg', 2500, 40000, 'ภาพวาด', 0, 0, 13.799434, 100.5503616, 0, 'Graphic designer and independent artist, who was once aspired to be an architect, his dream career, but failed to realize it when he was a young student.\r\n\r\nPariwat began his career as a designer since he was a third-year undergraduate, persuaded by Mr. Santi Lawrachawee, Designing Director of Practical Design Studio. Starting up his career there at the time of his graduation, but resigning later, in order to manage his family business at Ratchaburi. At the time being, he was a part-time designer, acting upon behalf of Case, Inc., an independent group, while co-founding with his friends a small publishing house called Unfinished Project Publishing, and continuously producing outputs of artworks. He had his exhibitions at Art’PsodieGallery, France; ArtWithAmbition, the Netherlands; ArtigGalerie, Germany; Artling, Singapore; InbeArtSpace, Japan, Alliance Française de Bangkok and ArtGorillas ArtGallery, Thailand.\r\n\r\nAt present, Pariwat is a designing director of THE UNI_FORM Design Studio, which is co-founded by him and Wutthipat Somjit, and visiting lecturer at Bangkok University. Still, he is enjoying his work and keeping producing his artworks in pace no slower than usual. ', 'Graphic designer and independent artist, who was once aspired to be an architect, his dream career, but failed to realize it when he was a young student.\r\n\r\nPariwat began his career as a designer since he was a third-year undergraduate, persuaded by Mr. Santi Lawrachawee, Designing Director of Practical Design Studio. Starting up his career there at the time of his graduation, but resigning later, in order to manage his family business at Ratchaburi. At the time being, he was a part-time designe', NULL),
