(142, 24, 'Paper tole shop', 'ด้วยตระหนักถึงคุณค่าในมรดกแห่งศิลปะและวัฒนธรรมไทย จึงได้บรรจงสร้างสรรค์งานหัตถศิลป์ ซึ่งเป็นศิลปะจากงานกระดาษ ที่เรียกว่า "ไตรมิติศิลป์" หรือ "เปเปอร์โทล์" จากกลุ่มคนรักงานศิลปะนาม "ช่อฟ้า" ภายใต้นิยาม "ศิลปะแห่งบุคลิก" นับทศวรรษ... ที่ "ช่อฟ้า" ได้สร้างสรรค์งานทำมือที่ประณีตบรรจง โดยซ้อนภาพราวกับมีมิติสะท้อนผ่านกระดาษ ถือเป็นการผสมผสานงานศิลปะทางตะวันตกเข้ากับวิถีและศิลปวัฒนธรรมไทย เพื่อคงไว้เอกลักษณ์อันงดงาม จึงนับได้ว่า ชิ้นงาน "ไตรมิติศิลป์" นี้เป็นงานหัตถศิลป์ที่ทรงคุณค่าและมีคุณลักษณะพิเศษที่บรรจงสร้างสรรค์อย่างวิจิตรตระการตา สำหรับบุคคลสำคัญ เฉกเช่น "คุณ" งานกระดาษ 3 มิติ ฝีมือคนไทยที่สวยงาม รายละเอียดไร้ที่ติด เริ่มต้นจากการวาดภาพลงบนกระดาษและทำการตัดออกมาเป็นชิ้นส่วนต่างๆ แล้วนำมาประกอบกันใหม่เป็น 3 layer เพื่อทำให้รูปภาพดั้งเดิมนั้นเกิดมิติเหมือนดั่งลอยออกมาโลดเล่นอยู๋นอกแผ่นกระดาษ งานศิลปะของทาง Paper tole ไม่ได้มีขายอยู่ภายในร้านที่จตุจักรเท่านั้น ภายใน King power ก็มีเพื่อให้ชาวต่างชาติได้ซื้อรูปศิลปะของไทยกลับไปเป็นของฝากอีกด้วย ทั้งรุปเรือสุพรรณหงส์ หนุนมาน หรือแม้กระทั้งรถตุ๊กๆ เหมาะเป็นอย่างมากถ้าท่านต้องการของฝากซักชิ้นที่ทรงคุณค่า ราคาเหมาะสม และไม่เหมือนใคร นอกจากนี้รูปแต่ล่ะชิ้นยังผลิตขึ้นในจำนวนจำกัด ซึ่งถ้ารูปไหนหมดแล้ว ก็จะไม่ผลิดใหม่อีกเลย ทำให้ยิ่งเป็นของสะสมหรือของขวัญที่มีคุณค่ามากขึ้นไปอีก', '1455167592-DSC_0069.jpg', 'ตลาดนัดจตุจักร', 1962, 4, '082 695 5459', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'chorfah@hotmail.com', 'ไม่ระบุ', 'www.papertoleshop.com', '1455167592-950.jpg', 100, 1000, 'งานศิลป์', 1, 0, 13.799434, 100.5503616, 0, '3d art, also known as paper tole, is art probably gets the vote for the most diverse, yet realistic form of art. An art form for over 200 years, Paper Tole is highly prized for its total uniqueness. Several prints of the same picture are painstakingly cut by hand using exacto knives and artful skill. Artisans know of the costly expense and consumption of time required to master an image. They must have knowledge of cutting as well as what to cut, what to keep, what to throw away and how to glue, block, shape, and form. These works are unique and exquisite, a perfect addition to any wall in your house.', '', NULL),
