(228, 19, 'kanta', 'แฟชั่นสไตล์วินเทจ สาวๆที่ชื่นชอบสไตล์วินเทจต้องมาร้านนี้เลย ร้านหรูตั้งอยู่ในตลาดนัดจตุจักร ร้านตกแต่งสวยงาม เข้ามาข้างในร้านก็เจอเสื้อผ้าสไตล์วินเทจให้เลือกมากมาย มีหลายแบบหลายสไตล์ ใครชอบแบบไหนก็เลือกกันตามสบาย ราคาเป็นกันเอง ถูกใจสาวสไตล์วินเทจแน่นอน', '1456048333-20151121_124824.jpg', 'ตลาดนัดจตุจักร โครงการ 23 ซอย 32/3 เลขที่ 125/126', 961, 1, '081 815 5466 ,081 657 0459', 'https://www.facebook.com/Kanta-Shop', 'ไม่ระบุ', 'cat.kantashop', '888@kantashop.com', 'ไม่ระบุ', 'www.kantashop.com', '1456048333-950.jpg', 100, 1000, 'เครื่องแต่งกาย', 0, 0, 13.799434, 100.5503616, 0, '', '', NULL),
