(230, 19, 'new normal', 'กระเป๋าแนวๆ เท่ๆ\r\n\r\nกระเป๋าจากวัสดุพิเศษของเรา แต่จะใบจะมีริ้วรอยที่แตกต่างกันตามลักษณะการใช้งาน กระเป๋าในรูปผ่านการใช้งานมาแล้วประมาณ 6เดือน โดนน้ำ โดนฝน ใส่ของหนัก ลุยไปกันมาแล้วทุกที่ ถึงแม้รูปลักษณ์จะดูเหมือนกระดาษ แต่ไม่ต้องเป็นห่วงเรื่องการใช้งานเลย', '1456048979-20151121_130451.jpg', 'ตลาดนัดจตุจักร โครงการ 23 ซอย 31/3 ห้อง 310', 1281, 4, '086 386 8093', 'NewNormalbyBLAst', 'NewNormal_official', 'ไม่ระบุ', 'blaststudio.info@gmail.com', 'ไม่ระบุ', 'www.new-normal.net', '1456048979-950.jpg', 500, 5000, 'กระเป๋า', 0, 1, 13.799434, 100.5503616, 0, 'Cool bag\r\n\r\nBag from our special materials. But the leaves will have different wrinkles according to their use. Bag in the picture has been used for about 6 months, hit the rain, put heavy weight to go everywhere. Although look looks like paper. But do not worry about using it.', '酷和時尚手袋\r\n\r\n我們的特殊材料製成的袋但線根據使用有所不同。通過使用一個袋子，然後碰到水約6個月的大雨經歷這一切的。雖然它看起來像紙。不過不要擔心了。', NULL),
