(232, 18, 'baanfai', 'จำหน่ายเสื้อผ้ามัดย้อม \r\n\r\n บ้านของฝ้ายย้อม  ซึ่งเป็นบ้านของฝ้ายย้อมสีได้รับการค้นพบในปี 1985 ด้วยความรักและสร้างความประทับใจในเสน่ห์ของเสื้อผ้าผูกย้อมพร้อมกับการปรับปรุงอย่างต่อเนื่องบ้านแฟร์ได้กลายเป็นศูนย์กลางการย้อมสีชั้นนำของโลก\r\n\r\nที่บ้านฟายเราได้ผลิตเสื้อผ้าผูกไทหลายแบบ ผ้าบาติกผูกย้อมสีน้ำตาลแดงอัญมณี ผ้าไหมภาพวาดผ้าภาพวาดและหน้าจอพิมพ์ ผลงานทั้งหมดของเราทำด้วยมืออย่างประณีต\r\n\r\nเสื้อผ้าที่ผูกเน็คไทมีรูปแบบที่ไม่คาดคิดดังนั้นการออกแบบสร้างสรรค์ที่ไม่คาดฝันจึงกลายเป็นงานชิ้นเอกที่ยอดเยี่ยมเรายังสามารถกล่าวได้ว่าผลิตภัณฑ์แต่ละชิ้นของเรามีเอกลักษณ์เฉพาะตัว', '1456049906-20151121_133136.jpg', 'ตลาดนัดจตุจักร โครงการ 23 ซอย 31/5', 2022, 3, '025 899 684, 029 528 235-6, 081 811 5230', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'baanfai2000@hotmail.com', 'ไม่ระบุ', 'www.baanfaimudyom.com', '1456049906-950.jpg', 100, 1000, 'ผ้ามัดย้อม', 0, 0, 13.799434, 100.5503616, 0, 'Dye clothes\r\n\r\n Home of cotton dyed Which is the home of cotton dyed, was discovered in 1985 with a passion and impressed by the charm of tie-dyed clothing, along with continuous improvements.\r\n\r\n\r\nAt Fai House we have produced many tied clothes. Batik dyed reddish brown gems. Silk painting, fabric painting and screen printing. All our works are handmade finely.\r\n\r\nTied clothes have an unexpected theme, so unexpected creative designs are a great masterpiece. We can say that each of our products is unique.', '紮染服裝\r\n\r\n\r\n棉花染色這是棉花染色的家在1985年被發現的激情和魅力的紮染服裝留下深刻的印象，與持續的更新以及家居博覽會已成為全球領先的染料的樞紐。\r\n\r\n\r\n網絡在家裡，我們已經產生了很多衣服和領帶。蠟染紮染棕紅色的寶石。絲畫，布畫和絲網印刷。手工製作的精美的全部作品。\r\n\r\n\r\n服裝領帶形成太意外了，意外的創意設計傑作成為一個美妙的產品，我們也可以說，我們每個人都是獨一無二的。', NULL),
