(276, 23, 'd-narn', 'สบู่และสินค้าสำหรับสปา', '1456059736-20151122_143251.jpg', 'ตลาดนัดจตุจักร โครงการ 19 ซอย 7/1 เลขที่ 203-204, โครงการ 11 ซอย 12/8 เลขที่ 206-207', 1665, 4, '081 926 9797, 081 399 9669', 'dnarnspa', 'ไม่ระบุ', 'ไม่ระบุ', 'd-narnspa@hotmail.com', 'ไม่ระบุ', 'www.d-narnspa.com', '1456059736-950.jpg', 100, 1000, 'สปา', 0, 0, 13.799434, 100.5503616, 0, 'Soaps and products for spa.If there’s one beauty product I can’t resist nowadays, it’s fancy handmade soaps with exotic scents and if there’s one country with plenty of these products, it’s Thailand which is like spa heaven. Some of these soaps can be quite pricey, I went to a shop in MBK which had loads of such soaps and each one was around RM20 but I got these 6 D-Narn Spa soaps for 330 baht. You can buy then individually but getting 6 of them works out to be cheaper. Everything in Thailand is a lot cheaper if you buy more than 1.\r\n\r\nD-Narn is a small shop in Chatuchak Market, I am sure I may never stumble upon it again since I always get hopelessly lost there. Their soaps are beautiful and smell so fantastic that it took me some time to decide on these 6 pieces.I have never seen an Iced Tea soap before and Moke Flower is a must-have scent from Thailand as this scent seems to be quite common in Thailand but not available here.\r\n\r\nThe soaps are wrapped in clear celllophane, not much fancy packaging here. The cellophane tended to stick to the soaps when I started unwrapping them. I started using Coconut and Mango first and they didn’t hold very well, breaking into quarters after a few uses. Funnily enough, I didn’t have the same problem with the rest of the soaps. Each one lasted about 2-3 weeks with daily use. I don’t think I would go back for these again as some of them broke easily but the shop has other products I’d like to take a closer look at.\r\nhttp://www.junipersjournal.com/d-narn-spa-soaps/', '肥皂和產品spa.如果有一個美容產品，我現在無法抗拒，它是一個漂亮的手工皂與異國情調的香水，如果有一個國家有這些產品，這是泰國，就像溫泉天堂。這些肥皂中的一些可以相當昂貴，我去了一家MBK的商店，裡面裝著這樣的肥皂，每一個都在RM20左右，但是我拿到了這6只D-Narn水療肥皂，達到了330泰銖。你可以單獨購買，但是得到6個可以更便宜的。如果您購買超過1個，泰國的一切便宜得多。\r\n\r\nD-Narn是Chatuchak市場上的一家小商店，我相信我可能永遠不會再絆倒，因為我總是在那裡失去意義。他們的肥皂是美麗的，氣味太棒了，花了我一些時間來決定這六件。我從來沒有見過一個冰醋茶，而莫斯科花是來自泰國必備的氣味，因為這種香味似乎很普遍泰國，但在這裡不可用。\r\n\r\n肥皂被包裹在透明的細胞中，這裡沒有太多的花式包裝。當我開始解開時，玻璃紙傾向於粘在肥皂上。我開始使用椰子和芒果，他們沒有保持得很好，經過幾個用途打破了宿舍。有趣的是，我沒有與其他肥皂相同的問題。每次使用約2-3週。我不認為我會再次回來，因為有些人很容易打破，但店裡還有其他的產品，我想仔細看看。', NULL),
