(308, 21, 'Loft life', 'จะของเก่า classic Retro หรือแอนทีค ไม่ว่าคำไหนก็หาได้ทั้งหมดภายในร้านนี้ร้านเดียวครับ Loft life มีทุกอย่างที่พูดมาเลยครับ รับรองว่าของหลายๆชิ้นไม่เคยเห็นที่ไหนมาก่อนแน่นอน บางชิ้นเราอาจเคยเห็นเฉพาะแค่ในหนัง แต่เราสามารถเจอตัวเป็นๆได้ที่ร้านนี้เลยครับ รับรองว่าตื่นตาตื่นใจอย่างแน่นอน  \r\n\r\nไม่ว่าจะเป็น เก้าอี้ตัดผม หมวกนักดำน้ำแบบโบราณ โคมไฟ โต๊ะไม้ พิมดีด กล้องถ่ายรูป หนังสือเก่า ตู้เกมส์ จักรยาน มอเตอไซด์ อะไรก็ตามที่นึกออกเกี่ยวกับของเก่า ของ retro พูดชื่อมาได้เลยครับ เจอทุกชิ้นที่ร้านนี้ครับ', '1456306655-DSC_0724.jpg', 'JJ Plaza Zone B ซอย 4 ห้อง 76', 1856, 5, '086 566 5917, 093 024 8894', 'facebook.com/loftllifebangkok', 'Loftlifebangkok', 'ไม่ระบุ', 'loftllifebangkok@gmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1456306655-950.jpg', 100, 5000, 'เฟอร์นิเจอร์', 0, 0, 13.799434, 100.5503616, 0, 'It antique or classic Retro Antique words, whether it\'s for all within this single store Loft life I have everything that I say. That many of the pieces have never been seen before, of course. Some of us may have seen only in movies. But we can see that this is not it. That excitement certainly \r\n\r\nintage, Japanese Antique & Industrial Furniture Shop', '它的古董或經典復古仿古的話，無論是這一切的單店閣樓內的生活我有我說的一切。，許多作品都從未見過的，當然。我們中有些人可能只看到在電影中。但是我們可以看到，這是不是。當然這種興奮', NULL),
