(313, 21, 'nice little clay', 'เดินผ่านแล้วคงไม่มีคนไหนไม่สะดุดตากับร้านๆนี้แน่นอนครับ nice little clay เป็นร้านเครื่องปั้นดินเผา  Handmade ที่มีลวดลายน่ารักๆ กวนๆ แบบไม่เหมือนใครครับ มีทั้งแก้วน้ำ จาน ชาม ที่เขี่ยบุหรี่ ตุ๊กตา และถ้วยกาแฟ ใครกำลังหาของที่แปลกตาไว้ใช้ที่บ้านหรือที่ทำงาน ใช้แล้วต้องมีคนถามว่าซื้อมาจากไหนทำไมเท่จัง รีบมาร้านนี้ได้เลยครับ', '1456307450-SAM_9179.jpg', 'ตลาดนัดจตุจักร โครงการ 7 ซอย 5', 3016, 4, '0946389956', 'facebook.com/nicelittleclay', 'ไม่ระบุ', 'nicelittleclay', 'nicelittleclay@gmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1456307450-950.jpg', 100, 1000, 'ลายแก้วแฮนด์เมด', 0, 0, 13.799434, 100.5503616, 0, 'ชาม ถ้วย แก้ว แฮนด์เมด', 'ชาม ถ้วย แก้ว แฮนด์เมด', '2018-07-08 05:54:46'),
