(349, 18, 'common-t', 'เสื้อคุณภาพดี ใช้ผ้าอย่างดี มีดีไซน์ที่โดดเด่นดูทันสมัย ใส่แล้วดูดี และภูมิฐาน มีความเป็นแฟชั่น ใส่ได้ทั้งผู้ชาย และผู้หญิง ลูกค้าท่านใดที่ชอบความเรียบง่าย มีสไตล์ ดูมินิมอล ก็ขอให้เก็บร้านนี้ไว้ในอ้อมใจ', '1464950566-JJ 2nd_3746.jpg', 'ตลาดนัดจตุจักร โครงการ 2 ซอย 3', 1184, 1, '02 615 8998 ', 'https://www.facebook.com/commontshirt', 'ไม่ระบุ', 'songwuttt', 'bangkokapparel.co@gmail.com', 'ไม่ระบุ', 'www.common-store.com', '1464950566-950.jpg', 290, 1000, 'เสื้อแฟชั่นเรียบง่าย', 0, 0, 13.799434, 100.5503616, 0, 'Common-T products combine the functionality of raw material and the artistic designs which are from the inspiration of modernization and the legends’ characteristics that we express on each T-shirt product. Our items are basic style which included by black and white T-shirt that is screened or printed the different designs which is full of feelings and passions of its design that would be represented by the character of the customers and can be mixed and matched with common-T jeans as well. A casual style of Common-T is a combination of a very fashionable and a classical casual style which we create delicately for the customer who love T-shirt and basic items.', 'Common-T products combine the functionality of raw material and the artistic designs which are from the inspiration of modernization and the legends’ characteristics that we express on each T-shirt product. Our items are basic style which included by black and white T-shirt that is screened or printed the different designs which is full of feelings and passions of its design that would be represented by the character of the customers and can be mixed and matched with common-T jeans as well. A ca', NULL),
(351, 18, 'beloxy', 'เสื้อผ้าแฟชั่น ดูดีเรียบหรู ใส่ไปเที่ยวหรือไปทำงานก็ได้ สาวๆคนไหนที่ต้องการตามหาเสื้อผ้าที่ดูเรียบหรูมาเลือกร้านนี้ได้เลยรับรองถูกใจ เพราะนอกจากจะทำจากเนื้อผ้าที่มีคุณภาพแล้ว แบบชุดก็ยังมีหลากหลายเหมาะกันสาวๆทุกสไตล์เลย', '1464951911-20160528_134756.jpg', 'ตลาดนัดจตุจักร โครงการ 2 ห้อง 267 / โครงการ 4 ห้อง 198', 1118, 1, '098 265 3051', 'https://www.facebook.com/beloxybkk', 'beloxybkk ', 'belonx_brand', 'antiboringlife@hotmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1464951911-950.jpg', 100, 1000, 'เสื้อผ้าแฟชั่น', 0, 0, 13.799434, 100.5503616, 0, 'เสื้อผ้าแฟชั่น ดูดีเรียบหรู ใส่ไปเที่ยวหรือไปทำงานก็ได้ สาวๆคนไหนที่ต้องการตามหาเสื้อผ้าที่ดูเรียบหรูมาเลือกร้านนี้ได้เลยรับรองถูกใจ เพราะนอกจากจะทำจากเนื้อผ้าที่มีคุณภาพแล้ว แบบชุดก็ยังมีหลากหลายเหมาะกันสาวๆทุกสไตล์เลย', 'เสื้อผ้าแฟชั่น ดูดีเรียบหรู ใส่ไปเที่ยวหรือไปทำงานก็ได้ สาวๆคนไหนที่ต้องการตามหาเสื้อผ้าที่ดูเรียบหรูมาเลือกร้านนี้ได้เลยรับรองถูกใจ เพราะนอกจากจะทำจากเนื้อผ้าที่มีคุณภาพแล้ว แบบชุดก็ยังมีหลากหลายเหมาะกันสาวๆทุกสไตล์เลย', NULL),
(352, 18, 'chicy dudes', 'เสื้อแฟชั่นหลายแบบหลากหลายสไตล์ สินค้าออริจินอล งานครบ ตัวแท้จากโรงงาน ตามเทรนแฟชั่นสุดๆต้องร้านนี้เลย สาวๆคนไหนเป็นเจ้าแม่แฟชั่นนิสต้าตัวจริง ต้องมาเลือกชมเสื้อผ้าแฟชั่นสุดเริ่ดที่ร้านนี้เลย รับรองเกร๋สุดๆ', '1464952332-JJ 2nd_5469.jpg', 'ตลาดนัดจตุจักร โครงการ 16 ซอย 2 เลขที่ 232-234 / โครงการ 18 ซอย 2 เลขที่ 173-174', 1073, 1, '081 234 8516-7', 'https://www.facebook.com/Chicky.Dudes', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', '1464952332-950.jpg', 100, 1000, 'เสื้อผ้าแฟชั่น', 0, 0, 13.799434, 100.5503616, 0, 'เสื้อแฟชั่นหลายแบบหลากหลายสไตล์ สินค้าออริจินอล งานครบ ตัวแท้จากโรงงาน ตามเทรนแฟชั่นสุดๆต้องร้านนี้เลย สาวๆคนไหนเป็นเจ้าแม่แฟชั่นนิสต้าตัวจริง ต้องมาเลือกชมเสื้อผ้าแฟชั่นสุดเริ่ดที่ร้านนี้เลย รับรองเกร๋สุดๆ', 'เสื้อแฟชั่นหลายแบบหลากหลายสไตล์ สินค้าออริจินอล งานครบ ตัวแท้จากโรงงาน ตามเทรนแฟชั่นสุดๆต้องร้านนี้เลย สาวๆคนไหนเป็นเจ้าแม่แฟชั่นนิสต้าตัวจริง ต้องมาเลือกชมเสื้อผ้าแฟชั่นสุดเริ่ดที่ร้านนี้เลย รับรองเกร๋สุดๆ', NULL),
