(364, 18, 'misss', 'จำหน่ายเสื้อผ้า ราคาพิเศษสุดๆ สาวออฟฟิศใส่ไปทำงานได้ดูดี หรือจะใส่ไปเที่ยวก็ได้ เพราะชุดดูไม่เป็นทางการมากแต่ก็ไม่ได้ดูปล่อยจนเกินไป ทำให้ดูสวยแบบพอดีไม่มากเกินไม่น้อยเกิน สาวๆคนไหนชอบเสื้อผ้าแฟชั่นที่ใส่ได้ในทุกโอกาสก็มาเลือกชมกันได้', '1464963982-JJ 2nd_8755.jpg', 'ตลาดนัดจตุจักร โครงการ 3 ซอย 42/0 เลขที่ 021-022', 674, 1, 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'Flsuphanita', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', '1464963982-950.jpg', 200, 200, 'เสื้อผ้าแฟชั่น', 0, 0, 13.799434, 100.5503616, 0, 'จำหน่ายเสื้อผ้า ราคาพิเศษสุดๆ สาวออฟฟิศใส่ไปทำงานได้ดูดี หรือจะใส่ไปเที่ยวก็ได้ เพราะชุดดูไม่เป็นทางการมากแต่ก็ไม่ได้ดูปล่อยจนเกินไป ทำให้ดูสวยแบบพอดีไม่มากเกินไม่น้อยเกิน สาวๆคนไหนชอบเสื้อผ้าแฟชั่นที่ใส่ได้ในทุกโอกาสก็มาเลือกชมกันได้', 'จำหน่ายเสื้อผ้า ราคาพิเศษสุดๆ สาวออฟฟิศใส่ไปทำงานได้ดูดี หรือจะใส่ไปเที่ยวก็ได้ เพราะชุดดูไม่เป็นทางการมากแต่ก็ไม่ได้ดูปล่อยจนเกินไป ทำให้ดูสวยแบบพอดีไม่มากเกินไม่น้อยเกิน สาวๆคนไหนชอบเสื้อผ้าแฟชั่นที่ใส่ได้ในทุกโอกาสก็มาเลือกชมกันได้', NULL),
(366, 19, 'j.m.bangkok', 'จำหน่าย กระเป๋าเป้ กระเป๋าสะพายข้าง ลายพริ้นหลากหลายมีให้เลือกมากมาย กระเป๋าก็มีให้เลือกหลายแบบ ลูกค้าชอบแบบไหนก็สามารถเลือกได้เลย ราคาไม่แพง แต่กระเป๋าใช้ได้นาน หันมาใช้กระเป๋าผ้าช่วยลดโลกร้อนได้อีกด้วย', '1464965027-JJ 2nd_3447.jpg', 'ตลาดนัดจตุจักร โครงการ 3 ซอย 46/2 เลขที่ 296', 726, 1, 'ไม่ระบุ', 'ไม่ระบุ', 'j.m.bangkok', 'j.m.bangkok', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', '1464965027-950.jpg', 200, 400, 'กระเป๋า', 0, 0, 13.799434, 100.5503616, 0, 'จำหน่าย กระเป๋าเป้ กระเป๋าสะพายข้าง ลายพริ้นหลากหลายมีให้เลือกมากมาย กระเป๋าก็มีให้เลือกหลายแบบ ลูกค้าชอบแบบไหนก็สามารถเลือกได้เลย ราคาไม่แพง แต่กระเป๋าใช้ได้นาน หันมาใช้กระเป๋าผ้าช่วยลดโลกร้อนได้อีกด้วย', 'จำหน่าย กระเป๋าเป้ กระเป๋าสะพายข้าง ลายพริ้นหลากหลายมีให้เลือกมากมาย กระเป๋าก็มีให้เลือกหลายแบบ ลูกค้าชอบแบบไหนก็สามารถเลือกได้เลย ราคาไม่แพง แต่กระเป๋าใช้ได้นาน หันมาใช้กระเป๋าผ้าช่วยลดโลกร้อนได้อีกด้วย', NULL),
(367, 19, 'TATHATA', 'ตถตาเกิดจากความชื่นชอบในงานหนัง ที่มีความคลาสสิค ใช้ได้ทุกยุคสมัย จึงเรื่มศึกษาตั่งแต่วิธีการเลือก การนำมาใช้ รวมการดูแลรักษา ทำให้เห็นเสน่ห์ของวัสดุประเภทนี้ ยิ่งใช้ยิ่งสวย ยิ่งใช้ยิ่งมีคุณค่า ทำให้รู้สึกหลงรักในวัสดุประเภทนี้ และด้วยเหตุผลเหล่านี้ การเลือกสรรหาหนัง และกระบวนการทำผลิตภัณฑ์ทุกชิ้น จึงเกิดจากความรักและความใส่ใจ ทำขึ้นมาทีละชิ้นด้วยมือ ซึ่งเพิ่มเสน่ห์ และคุณค่าให้กับผลิตภัณฑ์ ในแบบที่ผลิตภัณฑ์อุตสาหกรรมไม่สามารถทำได้', '1464965395-JJ 2nd_2078.jpg', 'ตลาดนัดจตุจักร โครงการ 4 ซอย 47/1 เลขที่ 012', 1388, 4, 'ไม่ระบุ', 'tathatabrand', 'tathatabrand', 'tathatabrand', 'tathatabrand@gmail.com', 'ไม่ระบุ', 'http://www.tathatabrand.com', '1485663261-1.jpg', 100, 1000, 'กระเป๋า นาฬิกา เข็มขัด สายกล้อง ', 0, 0, 13.799434, 100.5503616, 0, 'TATHATABRAND is lifestyle brand based in Thailand. Founded in 2012 by two partners Vipavat Darapongsataporn and Kavita Srisan. TATHATABRAND was born out of love for leather work and its timelessness. After an extensive study on every aspect of leather products was done, it had become clear that the real beauty of leather products only comes out through everyday uses. The more you use it, the higher the value.', 'TATHATABRAND是總部設在泰國的生活方式品牌。 成立於2012年由兩個合作夥伴Vipavat Darapongsataporn和Kavita Srisan。 TATHATABRAND是出於對皮革工作的愛和它的永恆。 在對皮革產品的各個方面進行了廣泛的研究之後，已經清楚的是，皮革產品的真正美麗只是通過日常使用而出現。 使用的越多，值越高。', NULL),
(368, 19, 'bigfoot', 'รองเท้าหนังแท้ แฮนเมด ขายปลีก - ส่ง ส่งออก รับสั่งทำตามออเดอร์ สามใส่ได้ทั้งคุณผู้ชาย และ คุณผู้หญิง แข็งแรงทนทาน สามใส่สบาย ผลิตจากหนังแท้ ในวันลำลอง หรือวันทำงาน ถ้าอยากให้เป็น ทางการมากขึ้น ทางร้านสามารถ ปรับเปลี่ยนด้วยการเพิ่ม รัดส้น ให้คุณลูกค้าได้ใช้งานได้', '1464965764-JJ 2nd_4260.jpg', 'ตลาดนัดสวนจตุจักร โครงการ 4 ซอย 48/1-2 ห้อง 085 และ 074', 2048, 1, '081 400 9540', 'Bigfoot-Sandal', 'ไม่ระบุ', 'chayaniya55', 'bigfoot_bkk@yahoo.com', 'ไม่ระบุ', 'ไม่ระบุ', '1464965764-950.jpg', 100, 1000, 'รองเท้าหนัง', 0, 0, 13.799434, 100.5503616, 0, 'Handmade Leather Sandal', 'Handmade Leather Sandal', NULL),
(369, 21, 'santana handicraft', 'จำหน่ายอุปกรณ์ตกแต่งบ้าน หรือตกแต่งงานอีเว้นท์ต่างๆ ทั้งโคมไฟกระดาษสีสันสวยงาม สินค้าทุกอย่างเป็นแฮนด์เมดมีคุณภาพ ใครที่ชอบงานฝีมือแฮนด์เมดแถมยังเอามาใช้ประโยชน์ได้มากมายก็น่าจะชอบ ที่สำคัญราคากันเองสุดๆ', '1464966269-JJ 2nd_962.jpg', 'ตลาดนัดจตุจักร โครงการ 4 ซอย 48/2', 721, 1, '095 235 9142 ,094 645 3564', 'ไม่ระบุ', 'ไม่ระบุ', 'ommie', 'thaipaper@hotmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1464966269-950.jpg', 100, 1000, 'โคมไฟห้อยระย้า', 0, 0, 13.799434, 100.5503616, 0, 'จำหน่ายอุปกรณ์ตกแต่งบ้าน หรือตกแต่งงานอีเว้นท์ต่างๆ ทั้งโคมไฟกระดาษสีสันสวยงาม สินค้าทุกอย่างเป็นแฮนด์เมดมีคุณภาพ ใครที่ชอบงานฝีมือแฮนด์เมดแถมยังเอามาใช้ประโยชน์ได้มากมายก็น่าจะชอบ ที่สำคัญราคากันเองสุดๆ', 'จำหน่ายอุปกรณ์ตกแต่งบ้าน หรือตกแต่งงานอีเว้นท์ต่างๆ ทั้งโคมไฟกระดาษสีสันสวยงาม สินค้าทุกอย่างเป็นแฮนด์เมดมีคุณภาพ ใครที่ชอบงานฝีมือแฮนด์เมดแถมยังเอามาใช้ประโยชน์ได้มากมายก็น่าจะชอบ ที่สำคัญราคากันเองสุดๆ', NULL),
(371, 18, 'melon vodka', 'อยากให้คนใส่อารมณ์ดี จนทำให้คนรอบข้างรู้สึกดี สินค้าทุกชิ้นทำมาจากผ้าคอตต้อน ออกแบบเป็นลิขสิทธิ์ของทางร้านโดยเฉพาะ มีทั้งเสื้อพิมพ์ลายน่ารักๆเกร๋ๆไม่ซ้ำแบบใคร หรือจะเป็นเดรสคอตต้อนก็น่ารักสุดๆ แบบที่ได้รับความนิยมจะเป็นผ้าคอตต้อนเนื้อนิ่มใส่สบาย ใส่แล้วไม่ร้อนแถมเนื้อผ้าก็ยังไม่บางจนเกินไปอีกด้วย', '1465111177-JJ 2nd_8398.jpg', 'ตลาดนัดจตุจักร โครงการ 21 เลขที่ 298-299', 985, 1, '091 881 8337 ,081 554 2537', 'https://www.facebook.com/MelonVodka', 'ไม่ระบุ', 'melonvodka', 'Melon-vodka@hotmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1465111177-Untitled-1.jpg', 180, 300, 'เสื้อผ้าเครื่องนุ่งห่ม', 0, 0, 13.799434, 100.5503616, 0, 'อยากให้คนใส่อารมณ์ดี จนทำให้คนรอบข้างรู้สึกดี สินค้าทุกชิ้นทำมาจากผ้าคอตต้อน ออกแบบเป็นลิขสิทธิ์ของทางร้านโดยเฉพาะ มีทั้งเสื้อพิมพ์ลายน่ารักๆเกร๋ๆไม่ซ้ำแบบใคร หรือจะเป็นเดรสคอตต้อนก็น่ารักสุดๆ แบบที่ได้รับความนิยมจะเป็นผ้าคอตต้อนเนื้อนิ่มใส่สบาย ใส่แล้วไม่ร้อนแถมเนื้อผ้าก็ยังไม่บางจนเกินไปอีกด้วย', 'อยากให้คนใส่อารมณ์ดี จนทำให้คนรอบข้างรู้สึกดี สินค้าทุกชิ้นทำมาจากผ้าคอตต้อน ออกแบบเป็นลิขสิทธิ์ของทางร้านโดยเฉพาะ มีทั้งเสื้อพิมพ์ลายน่ารักๆเกร๋ๆไม่ซ้ำแบบใคร หรือจะเป็นเดรสคอตต้อนก็น่ารักสุดๆ แบบที่ได้รับความนิยมจะเป็นผ้าคอตต้อนเนื้อนิ่มใส่สบาย ใส่แล้วไม่ร้อนแถมเนื้อผ้าก็ยังไม่บางจนเกินไปอีกด้วย', NULL),
