(390, 19, 'inky', 'เสื้อผ้าเครื่องแต่งกายเรียบหรู ดูดี มีสไตล์ ใส่แล้วรับรองว่าดูแพงดูดีแน่นอน มีทุกไซส์ทุกขนาด ทุกเพศ ทั้งหญิงและชายก็สามารถมาเลือกกันได้ ส่วนมากจะเป็นชุดที่ใส่ไปทำงาน ที่ออกเรียบๆ แต่ดูดี ใครที่กำลังมองหาเครื่องแต่งกายแนวนี้อยู่ก็ลองไปดูกันที่นี่เลย', '1465183409-JJ 1st_4033.jpg', 'ตลาดนัดจตุจักร โครงการ 23 ซอย 31', 1084, 1, '089 016 6664', 'ไม่ระบุ', 'inkychatuchak', '0890166664', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', '1465183409-Untitled-1.jpg', 100, 1000, 'เสื้อผ้าแฟชั่น', 0, 0, 13.799434, 100.5503616, 0, '', '', NULL),
(391, 19, 'j-girlie', 'ชุดเดรส เครื่องประดับ สไตล์วินเทจ ออกแบบเองจากทางร้านงานแฮนด์เมด สินค้าทุกชิ้นมีคอนเซปในการออกแบบ ลูกค้าท่านใดที่ชอบงานแฮนด์เมด สไตล์วินเทจ ร้านนี้ตอบโจทย์ได้ดีเลยทีเดียว เพราะของแต่ละชิ้น ต้องบอกเลยว่าเจ้าของร้านทำออกมาอย่างปราณีตและมีคุณภาพจริงๆ', '1465184154-JJ 1st_398.jpg', 'ตลาดนัดจตุจักร โครงการ 2 ซอย 39/2 เลขที่ 176 / โครงการ 3 ซอย 43/2 เลขที่ 181', 1042, 1, '081 626 6951', 'J-Girlie Vintage Accessories', 'JGIRLIE_VINTAGE', 'j-girlie', 'jgirlie2007@gmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1465184154-Untitled-1.jpg', 100, 1000, 'เดรส เครื่องประดับ', 0, 0, 13.799434, 100.5503616, 0, 'Vintage Dresses & Accessories\r\nWe designed & produce the best & chic of clothes & vintage accessories. Our products were inspired by romantic colors and my love for vintage. Made with the best material of fabric, bead, crystal and feathers. Perfect for the trendy who\'s also love in vintage style. \r\n" Our product is not just a product. But it is a work of art "\r\nNote about product:\r\n* Detail on each model can be a slightly different as this is handworks.\r\n** Some materials may have changed but still in the same concept of each model.\r\nDesigned and handmade by J-Girlie Vintage Accessories © All rights reserved', '', NULL),
(394, 20, 'ไทยบรรเจิด', 'จำหน่ายแว่นตาคุณภาพดี รูปทรงแนวๆ เท่ๆ เหมาะสำหรับชาวฮิปๆ มีให้เลือกหลายแบบหลายสไตล์ ถูกใจชิ้นไหนขอลองชิ้นนั้นได้เลย สามารถนำไปใช้เป็นแว่นกันแดด หรือจะเอาไปเปลี่ยนเลนส์เป็นแว่นสายตาก็เหมาะเหมือนกัน', '1465378043-JJ 1st_9579.jpg', 'ตลาดนัดจตุจักร โครงการ 3 เลขที่ 300', 856, 1, '090 986 8136 ,091 513 3236', 'thaibanjerd', 'thaibanjerd', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', '1465378043-Untitled-1.jpg', 100, 1000, 'แว่นตา', 0, 0, 13.799434, 100.5503616, 0, '', '', NULL),
(395, 18, 'how many tshirt', 'จำหน่ายเสื้อยืด กระเป๋า และเครื่องประดับอื่นๆ เสื้อยืดทำจากผ้าคอตต้อน 100% เนื้อผ้านิ่งใส่สบายไม่ร้อน ผ้าไม่บางไปไม่หนาไป แถมร้านนี้มีเสื้อลายน่ารักๆให้เลือกเยอะมาก วัยรุ่นใส่ได้ คนรุ่นใหญ่ใส่ดี กระเป๋าก็น่ารัก แถมมีตุ้กตาเสมือนจริงอีกด้วย', '1465378733-JJ 1st_8136.jpg', 'ตลาดนัดจตุจักร โครงการ 3, ซอย 44, เลขที่ 083-084 /ตลาดนัดจตุจักร โครงการ 4, ซอย 47/2, เลขที่ 036', 804, 1, '089 928 5656', 'https://www.facebook.com/howmanytshirt', 'ไม่ระบุ', 'ไม่ระบุ', 'howmanytshirt@gmail.com', 'ไม่ระบุ', 'www.howmanytshirt.com', '1465378733-Untitled-1.jpg', 200, 500, 'เสื้อยืด', 0, 0, 13.799434, 100.5503616, 0, 'We start it at home, once we found out that we are all have too many t-shirts and somehow we have idea to reuse those tees by making them patchwork or try to relive them by paint, draw over them, and ask our friend who run a shop at weekend market for sell them. It went quite well. We decide to do more collage on t-shirt from sort of left over materials which we collected from tailors, or fabric shops, they sold them to us cheap and we begin to own our little shop at the Jatujak weekend market in 2009.\r\n\r\nThe "Nature Project" is our core concept, it is sincere immense meaning. we realize that everything is interconnected, and nature joints them for us, to be able to understand other people, things etc...\r\n\r\nThe design concept on our t-shirts base on this very concept, we try to work with many people who could share their attitude, also we always look for interesting subject to work on, and it is nice, there is no ending when you say "nature" it\'s continuity.\r\n\r\nSome of our work on T-shirts, are made to drawing, sketches, painting, before become a print on t-shirt, some are mixture of different dimensions, like bird and leaves, which bird is inkjet printed but leaves are embroidered. this combinations lead us to work with some interesting tailors who work at home, mostly they are housewifes and enjoy working at home, so we transport materials, fabrics, to their houses, in order to understand how to work in a place with happiness. and we also learn from it as well.', '', NULL),
(396, 18, 'backtee', 'จำหน่ายเสื้อผ้า ทั้งชุดเดรส เสื้อ กางเกง เนื้อผ้าดี มีคุณภาพ ขายทั้งปลีกและส่ง ไม่ว่าจะเป็นสาวออฟฟิศ หรือสาวชอบเที่ยว ก็มาช้อปกันได้หมด เพราะร้านนี้มีหลายสไตล์ให้เลือก แถมยังดูดีอีกด้วย นอกจากนี้แล้วทั้งร้านยังขายราคาเดียวเท่านั้น ', '1465379299-JJ 1st_3240.jpg', 'ตลาดนัดจตุจักร', 559, 1, '081 456 8666', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', '1465379299-Untitled-1.jpg', 200, 200, 'เสื้อผ้า', 0, 0, 13.799434, 100.5503616, 0, '', '', NULL),
(397, 20, 'รัศมีสร้อยหิน', 'จำหน่ายสร้อยหิน ทำมาจากหินแท้ สวยงาม มีให้เลือกหลายสีหลายแบบ ท่านใดที่ชื่นชอบเครื่องประดับพวกสร้อยหิน ของแนะนำรัศมีสร้อยหิน เพราะเป็นสร้อยที่ทำอย่างปราณีต มีคุณภาพ แถมราคาไม่แพงมากด้วย', '1465379396-JJ 1st_7401.jpg', 'ตลาดนัดจตุจักร โครงการ 24 ซอย 3', 1655, 1, '081 438 5423', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', '1465379396-Untitled-1.jpg', 100, 1000, 'สร้อยหิน', 0, 0, 13.799434, 100.5503616, 0, '', '', NULL),
