(404, 19, 'button shoes thailand', 'ใครที่ชอบของแปลกของแนว รับรองเลยมาร้านนี้ ต้องชอบ และติดใจแน่นอน ร้านนี้จำหน่ายรองเท้าทำมือ โดยตกแต่งจากกระดุมหลากสีแปลกๆ ทุกอย่างทำมือล้วนๆ และมีดีไซน์ที่แปลกใหม่ไม่ซ้ำใคร มีหลายไซส์ให้เลือกมากมาย ตั้งแต่ไซส์เล็กๆสำหรับเด็กๆ ไปจนถึงไซส์บิ๊กๆอย่างคุณพ่อ สามารถใส่ได้ทุกคน หรือจะใส่เป็นครอบครัวก็น่ารักไปอีกแบบ', '1494227346-11263156_1588942631371492_8253377917193536516_n.jpg', 'ตลาดนัดจตุจักร โครงการ 21 เลขที่ 256 ซอย 28/2', 1171, 4, '081 817 6002 ,080 998 3777', 'House of Siree - Handmade Button Shoes', 'buttonshoesthailand', 'houseofsiree', 'ladykanha@hotmail.com', 'ไม่ระบุ', 'www.houseofsiree.com', '1494227828-9.jpg', 500, 3500, 'รองเท้าทำมือ', 0, 0, 13.799434, 100.5503616, 0, 'We are making and selling unique and creative handmade shoes using special buttons authentically designed available at MBK Bangkok, Thailand', '我喜歡的風格的新穎性。我證明這是一樣的，當然愛。這家商店出售手工製作的鞋五顏六色的各種按鈕的裝飾。一切都是手工製作的純設計新穎獨特。有許多尺寸可供選擇由於孩子小的尺寸。對任何大小大爸爸。任何人都可以進入或者把它作為一個家庭的愛再去了', NULL);
