(405, 28, 'casa oasis', 'จำหน่าย กระบองเพชรหลากสี หลายแบบ  และอุปกรณ์ตกแต่งต้นไม้อื่นๆอีกมากมาย ใครที่ชื่นชอบและหลงไหลต้นกระบองเพชรและชอบเพาะพันธ์พืชทั้งหลาย ก็ลองแวะมาเลือกมาดูกันได้ ร้านนี้ต้นไม้สวย คนขายก็ใจดีไปอีก แถมราคาก็ถูกด้วย รับรองถูกใจแน่นอน', '1469289397-950.jpg', 'ตลาดนัดจตุจักร โครงการ 5 เลขที่ 49-50', 767, 2, '081 735 4715 ,081 762 7972', 'casa oasis', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', '1469289397-20160618_140908.jpg', 100, 500, 'ต้นไม้', 0, 0, 13.799434, 100.5503616, 0, 'Cactus distribution of colors and decorative trees more. One of my favorite obsessions and cactus like plant breeding them. Try to choose to see it. This beautiful tree People are going to It was a price Favourites certification course', '顏色和裝飾用樹更仙人掌分佈。我最喜歡的執著和像仙人掌植物育種他們。盡量選擇才能看到它。這個美麗的樹人們將這是一個價格最愛認證課程', NULL),
(406, 18, 'cat soup', 'จำหน่ายเสื้อผ้า และเครื่องแต่งกาย สำหรับคนรักน้องเหมียว เป็นโอกาสดีที่จะให้น้องเหมียวติดตามเราไปทุกที ^^ ทั้งเสื้อผ้า ชุดเดรส กระเป๋าสะพาย กระเป๋าสตางค์ และอื่นๆอีกมากมาย ร้านนี้มาเพื่อกลุ่มคนรักน้องเหมียวโดยเฉพาะจริงๆ ใครที่ชื่นชอบน้องเหมียว ก็ลองไปเลือกชมร้านนี้กันได้เลย หาไม่ยาก และร้านตกแต่งน่ารักมากมาย', '1469289839-950.jpg', 'ตลาดนัดจตุจักร เลขที่ 232 ซอย 45/1 โครงการ 3', 1062, 5, 'ไม่ระบุ', 'CAT SOUP / does mondays', '_catsoup', 'ไม่ระบุ', 'acupofcatsoup@gmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1469289839-20160618_144502_1.jpg', 100, 1000, 'เสื้อผ้า', 0, 0, 13.799434, 100.5503616, 0, 'จำหน่ายเสื้อผ้า และเครื่องแต่งกาย สำหรับคนรักน้องเหมียว เป็นโอกาสดีที่จะให้น้องเหมียวติดตามเราไปทุกที ^^ ทั้งเสื้อผ้า ชุดเดรส กระเป๋าสะพาย กระเป๋าสตางค์ และอื่นๆอีกมากมาย ร้านนี้มาเพื่อกลุ่มคนรักน้องเหมียวโดยเฉพาะจริงๆ ใครที่ชื่นชอบน้องเหมียว ก็ลองไปเลือกชมร้านนี้กันได้เลย หาไม่ยาก และร้านตกแต่งน่ารักมากมาย', 'จำหน่ายเสื้อผ้า และเครื่องแต่งกาย สำหรับคนรักน้องเหมียว เป็นโอกาสดีที่จะให้น้องเหมียวติดตามเราไปทุกที ^^ ทั้งเสื้อผ้า ชุดเดรส กระเป๋าสะพาย กระเป๋าสตางค์ และอื่นๆอีกมากมาย ร้านนี้มาเพื่อกลุ่มคนรักน้องเหมียวโดยเฉพาะจริงๆ ใครที่ชื่นชอบน้องเหมียว ก็ลองไปเลือกชมร้านนี้กันได้เลย หาไม่ยาก และร้านตกแต่งน่ารักมากมาย', NULL),
(407, 20, 'cha-yo shop', 'จำหน่ายเครื่องประดับทำมือ ทำจากหินสี เชือกสีต่างๆ มีทั้งสร้อยคอ สร้อยข้อมือ ต่างหู ใครที่ชอบเครื่องประดับทำมือ ตกแต่งด้วยหินสี และเชื่อกหลากสีแล้วละก็ ต้องลองไปเลือกซื้อเลือกหาของที่ถูกใจกันได้เลย รับรองต้องตาต้องใจกันทุกคน อาจจะได้ของถูกใจแถมยังได้ของไปฝากญาติครอบครัวหรือเพื่อนๆก็เป็นได้', '1469290690-950.jpg', 'ตลาดนัดจตุจักร โครงการ 10 เลขที่ 84 ซอย 20/2', 1080, 1, '081 685 5926 ,086 375 3618', 'ไม่ระบุ', 'ไม่ระบุ', 'frog_top11 ,por_napatthira', 'chayo_handicraft@hotmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1469290690-20160618_155256.jpg', 100, 1000, 'เครื่องประดับ', 0, 0, 13.799434, 100.5503616, 0, 'จำหน่ายเครื่องประดับทำมือ ทำจากหินสี เชือกสีต่างๆ มีทั้งสร้อยคอ สร้อยข้อมือ ต่างหู ใครที่ชอบเครื่องประดับทำมือ ตกแต่งด้วยหินสี และเชื่อกหลากสีแล้วละก็ ต้องลองไปเลือกซื้อเลือกหาของที่ถูกใจกันได้เลย รับรองต้องตาต้องใจกันทุกคน อาจจะได้ของถูกใจแถมยังได้ของไปฝากญาติครอบครัวหรือเพื่อนๆก็เป็นได้', 'จำหน่ายเครื่องประดับทำมือ ทำจากหินสี เชือกสีต่างๆ มีทั้งสร้อยคอ สร้อยข้อมือ ต่างหู ใครที่ชอบเครื่องประดับทำมือ ตกแต่งด้วยหินสี และเชื่อกหลากสีแล้วละก็ ต้องลองไปเลือกซื้อเลือกหาของที่ถูกใจกันได้เลย รับรองต้องตาต้องใจกันทุกคน อาจจะได้ของถูกใจแถมยังได้ของไปฝากญาติครอบครัวหรือเพื่อนๆก็เป็นได้', NULL),
(408, 23, 'herb care', 'รับผลิตเครื่องสำอาง พร้อมจดแจ้ง อย. คุณภาพดี ผลิตจากสารสกัดธรรมชาติ และเป็นมิตรกับสิ่งแวดล้อม ลูกค้าจึงมั่นใจได้ว่าไม่ทำให้เกิดผลข้างเคียงใดๆแน่นอน ใครที่อยากเป็นเจ้าของแบรนด์ สามารถมาสั่งผลิตได้เลย ราคาไม่แพง และเป็นมิตรต่อสิ่งแวดล้อมอีกด้วย รับรองขายดีเป็นเทน้ำเทท่า', '1469335711-950.jpg', 'ตลาดนัดจตุจักร\r\nโครงการ 22 ซอย 30/3\r\nโครงการ 3 ซอย 2', 1066, 1, '081 853 7889 ,083 198 5956', 'Herbcare beauty cafe', 'ไม่ระบุ', 'Herbcare', 'Herb_care@hotmail.com', 'ไม่ระบุ', 'http://www.herbcarethailand.com/', '1469335711-20160618_152938.jpg', 100, 1000, 'รับผลิตเครื่องสำอางค์', 0, 0, 13.799434, 100.5503616, 0, 'We believe that the beauty always come with change. Change to have a better life but still stay with beautiful nature that belonging to us for a long time.\r\n\r\n“HerbCare” sources the finest herbal raw ingredients from Thailand to create the effective product with care & gentleness. Our products are created from the indigenous knowledge and added our expertise which you can use our natural products with confidence. We keep developing and now we are proud as our products are certified to be 5 stars OTOP of Thailand.\r\n\r\nWe concern about social responsibility as we accompany with the local people to give them chance and knowledge to create their jobs and let them join our success. In addition, we never test on animals, and all our products are  INSERT INTO `product_image` (`id`, `product_id`, `image`, `created_at`) VALUES
