(410, 19, 'igenfurnish', '"ไอ-เจ็น" ร้านค้านี้มีสไตล์ ไม่ซ้ำใคร ยินดีต้อนรับสู่ร้านไอ-เจ็น พบกับสินค้าไอเดียแปลกใหม่ อาทิ กระเป๋า เครื่องแต่งกาย ของประดับตกแต่ง ที่ทางร้านออกแบบและผลิตเอง ผลัดเปลี่ยนหมุนเวียนมาให้ทุกท่านได้เลือกซื้อเลือกชม มั่นใจในคุณภาพสินค้าของทางร้านได้เลย', '1469336886-950.jpg', 'ตลาดนัดจตุจักร โครงการ 16 ซอย 24/5 เลขที่ 94', 743, 1, '089 693 7293', ' igenfurnish', ' igenfurnish', 'r_muey', ' igenfurnish@gmail.com', 'ไม่ระบุ', 'http://www.igenfurnish.com', '1469336886-20160618_154652.jpg', 100, 1000, 'เครื่องแต่งกาย', 0, 0, 13.799434, 100.5503616, 0, '"ไอ-เจ็น" ร้านค้านี้มีสไตล์ ไม่ซ้ำใคร ยินดีต้อนรับสู่ร้านไอ-เจ็น พบกับสินค้าไอเดียแปลกใหม่ อาทิ กระเป๋า เครื่องแต่งกาย ของประดับตกแต่ง ที่ทางร้านออกแบบและผลิตเอง ผลัดเปลี่ยนหมุนเวียนมาให้ทุกท่านได้เลือกซื้อเลือกชม มั่นใจในคุณภาพสินค้าของทางร้านได้เลย', '"ไอ-เจ็น" ร้านค้านี้มีสไตล์ ไม่ซ้ำใคร ยินดีต้อนรับสู่ร้านไอ-เจ็น พบกับสินค้าไอเดียแปลกใหม่ อาทิ กระเป๋า เครื่องแต่งกาย ของประดับตกแต่ง ที่ทางร้านออกแบบและผลิตเอง ผลัดเปลี่ยนหมุนเวียนมาให้ทุกท่านได้เลือกซื้อเลือกชม มั่นใจในคุณภาพสินค้าของทางร้านได้เลย', NULL),
(411, 20, 'jack and flo', 'จำหน่ายเครื่องประดับ ทุกชิ้นทำมือออกแบบโดยเจ้าของร้านเอง ด้วยความปราณีตและออกแบบได้มาเป็นอย่างดี ทำให้สินค้าออกมามีคุณภาพ ใครใส่ก็สวยดูบุคลิกดี แถมเจ้าของร้านยังเป็นกันเองอีกด้วย ได้ของที่พอดีกับเราเลย เพราะสามารถให้ช่างตกแต่งตัดแต่ง ณ ตรงนั้นได้เลย เป็นกันเองแถมราคาก็ไม่แพงคุณภาพดีอีกด้วย', '1469337827-950.jpg', 'ตลาดนัดจตุจักร โครงการ 24 ซอย 33/4 เลขที่ 293', 989, 1, '088 343 3326', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'jjfollain@cagetel.net', 'ไม่ระบุ', 'ไม่ระบุ', '1469337827-20160618_152017.jpg', 100, 1000, 'เครื่องประดับ', 0, 0, 13.799434, 100.5503616, 0, 'จำหน่ายเครื่องประดับ ทุกชิ้นทำมือออกแบบโดยเจ้าของร้านเอง ด้วยความปราณีตและออกแบบได้มาเป็นอย่างดี ทำให้สินค้าออกมามีคุณภาพ ใครใส่ก็สวยดูบุคลิกดี แถมเจ้าของร้านยังเป็นกันเองอีกด้วย ได้ของที่พอดีกับเราเลย เพราะสามารถให้ช่างตกแต่งตัดแต่ง ณ ตรงนั้นได้เลย เป็นกันเองแถมราคาก็ไม่แพงคุณภาพดีอีกด้วย', 'จำหน่ายเครื่องประดับ ทุกชิ้นทำมือออกแบบโดยเจ้าของร้านเอง ด้วยความปราณีตและออกแบบได้มาเป็นอย่างดี ทำให้สินค้าออกมามีคุณภาพ ใครใส่ก็สวยดูบุคลิกดี แถมเจ้าของร้านยังเป็นกันเองอีกด้วย ได้ของที่พอดีกับเราเลย เพราะสามารถให้ช่างตกแต่งตัดแต่ง ณ ตรงนั้นได้เลย เป็นกันเองแถมราคาก็ไม่แพงคุณภาพดีอีกด้วย', NULL),
(412, 25, 'Cameraoutfitters', '"กล้องนี้คือ ประวัติศาสตร์"\r\nเมื่อเดือนพฤศจิกายน ปี 1948 Edwin Land ผู้ก่อตั้ง บ Polaroid ได้ออกวางจำหน่ายกล้องถ่ายแล้วได้ภาพเลย เป็นรุ่นแรกของโลก ซึ่งก็คือ Polaroid model 95 นี้นี่เอง ซึ่งถือว่าเป็นกล้องที่พลิกประวัติศาสตร์วงการกล้องฟิล์มกันเลยทีเดียว ซึ่งตอนนี้ก็นับเป็นเวลาเกือบ 70 ปีแล้วของกล้องรุ่นนี้ แล้วเราจะไม่เรียกว่าประวัติศาตร์ได้อย่างไร เทคโนโลยีจากอดีตเดินทางมาถึงมือทุกคนแล้วค่ะ ^^\r\n\r\nแค่ประโยคแบบนี้ เราก็รู้แล้วกล้องไม่ใช่แค่บันทึกภาพ แต่บันทึกความทรงจำมากมายที่ถ่ายทอดจากอดีตสู่ปัจจุบัน เจ้าของร้านมีความหลงใหลในกล้องถ้ายถาพและได้เก็บสะสม และได้มาแบ่งปันให้แก่คนอื่น', '1485613323-15977581_743624995785615_47323519282352902_n.jpg', 'Online', 643, 5, 'ไม่ระบุ', 'wearecameraoutfitters', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'www.facebook.com/wearecameraoutfitters/', '1485613323-14639832_695429963938452_939932355102352871_n.jpg', 3000, 10000, 'กล้องถ่ายรูป', 0, 0, 13.799434, 100.5503616, 0, '"This camera is history"\r\nNovember of 1948 Edwin Land, founder of Polaroid\'s camera has not released any pictures. The first version of the Polaroid model 95, which is on this camera, which is considered a revolutionary film industry ever. Now it is almost 70 years of this camera. Then we would not have called history. The former technology arriving every hand me ^^.\r\n\r\nJust sentence We know it\'s not just the camera to record images. But many memoirs convey the past to the present. The owner has a passion for the camera if Ita and collection. And to share them with others.', '“這台相機是歷史”\r\n1948年埃德溫·蘭德月，寶麗來的相機的創始人尚未發布任何照片。第一個版本寶麗模型95，這也是這台相機，這是以往任何時候都認為是一個革命性的電影產業上。現在是近70年這台相機。然後，我們就不會被稱為歷史。前者技術到達每一個遞給我^^。\r\n\r\n只是一句我們知道，它不只是相機記錄影像。但許多回憶錄傳達過去到現在。所有者具有相機，如果伊達和收藏的熱情。並與他人分享。', '2018-06-27 22:01:36'),
(413, 19, 'BAGSPACE', 'ถ่ายทอดทุกความเชื่อ และปรัชญาในตัวตนของแบรนด์ผ่านผืนหนังลงบนกระเป๋ามาถึง 6 ปีเต็ม ๆ และแล้ววันที่มุมมองของเราจะไม่ถูกจำกัดด้วยรูปแบบของสินค้า ...เราจึงตัดสินใจทลายกำแพงและกรอบเดิม ๆ ออกไป เริ่มต้นเดินกับทางใหม่ ๆ ด้วยสินค้าที่หลากหลายแต่ชัดเจนในตัวตน และพร้อมจะเป็นตัวแทนในการแสดงอัตลักษณ์แบบ Bagspace ที่อาจจะซ่อนอยู่ในตัวตนลึก ๆ ที่เมื่อคุณได้สัมผัส แล้วจึงจะค้นพบ!\r\n\r\nลองใช้ให้เซอร์ กับหนังแท้สไตล์ลุยๆ จาก Bagspace การันตีความ แก่ ดิบ กร้าน! หลังการใช้ \r\nคงไว้คำพูดเดิม! "เพราะร่องรอย คือ ลวดลาย" รองเท้าหนัง', '1485698009-136.jpg', 'Crystal Design Center  ', 986, 5, '080 810 0800, 089 109 1089', 'bagspace', 'ไม่ระบุ', '@Bagspace', 'care@bagspace.in.th', 'ไม่ระบุ', 'http://www.bagspace.in.th/', '1485698009-12.jpg', 500, 5000, 'shoes,Leather Goods', 0, 0, 13.799434, 100.5503616, 0, 'Broadcast every faith In philosophy and brand identity through a piece of leather on the bag arrived six years ago and that our views will not be limited by the form of the product. ... We decided to break down barriers and traditional frames to start walking with the new product range, but with a clear identity. And will be represented in the form Bagspace identity may be hidden in the deep when you touch. Then to discover!\r\n\r\nTry to Sir Louis style with leather from Bagspace Guaranteeing the raw beauty! After use\r\nMaintaining the old saying! "The evidence is patterned" shoes. Leather Goods\r\n\r\nThe essential of a journey is our collective connection to the time. Which develops into a unique worn-in effect or patina with time. -Bagspace\r\n\r\nBagspace believe in the functionality in design, quality of craftsmanship and the material used in the production. That\'s the reason of Bagspace came to respond to the need of the modern-day people mindful of the quality as well as the value of the product what people would acquire, with strong propositions around the appearance and durability of every product, it would make while remaining versatile for people of all age and lifestyle.\r\n\r\nWe wanted to find a new way to take a little piece of that feeling with us no matter where we found ourselves. So, we started making things that come from what is found or functional for all lifestyle and flexible. Couple that with a passion of leather and great design.', '每天播出的信心通過一塊皮革理念和品牌標識包裝袋上六年前來到，我們的觀點不會被產品的形式加以限制。 ......我們決定打破壁壘和傳統的框架開始與新產品系列中行走，但有一個明確的身份。並會在形式Bagspace標識可以在深，當你觸摸隱藏表示。然後去發現！\r\n\r\n嘗試爵士路易風格與Bagspace皮革保證原始之美！使用後\r\n維護古語！ “證據的圖案”鞋。', NULL),
(414, 21, 'REDWOOD', '"รับผลิตเฟอร์นิเจอร์ไม้จริงตามแบบลูกค้า" \r\n​\r\nบริการด้วยความตั้งใจ สินค้าทุกชิ้นรับประกัน 1 ปี ยินดีบริการจนกว่าลูกค้าจะพอใจและเตรียมพบกับสินค้าที่ทางบริษัทพัฒนาและออกแบบเองในอนาคต\r\n​\r\nโดยทีมงานมืออาชีพที่มีประสบการณ์และมีความรู้ในการทำเฟอร์นิเจอร์งานไม้แท้มา พร้อมให้บริการเสนอราคาตามความต้องการของลูกค้า และสามารถให้คำแนะนำและปรับเปลี่ยนตามงบประมาณที่ตั้งไว้ สไตร์สแกนดิเนเวีย\r\n​', '1491459766-15235405_232186857218091_6029544059648511338_o.jpg', 'Online', 662, 5, '086 551 7336, 092 256 0213', 'redwoodcarver', 'ไม่ระบุ', 'ไม่ระบุ', 'redcaso@gmail.com', 'ไม่ระบุ', 'www.redwoodcraver.com', '1485703759-1.jpg', 3500, 20000, 'สแกนดิเนเวีย', 0, 0, 13.799434, 100.5503616, 0, 'The word teak is derived from "redwood", which comes from Malayalam, an Indian dialect from the southern state of Kerala\r\nBeing "redwood", starting from our appreciation in mid-century furniture and the beauty of teakwood, therefore we decide to combine the style of Mid-Century with Modern Style into our items, in which of course, with Teakwood.\r\nWith our experiences in manufacturing and distribution Wooden Furniture, we are specialized in Teakwood Furniture Design and Made-to-Order Furniture.\r\nIf you are looking for wholesale furniture for decorating your business likewise office, restaurants, café s, etc… with our One-Stop Service, you can rest assured to let us be your furniture/interior consultant in creating your needs to meet up within your budget.', '“家具製造根據客戶”。\r\n\r\n志願服務所有的產品都保證一年歡迎的服務，直至客戶滿意，並準備滿足未來產品的設計和開發公司。\r\n\r\n在製作家具和木材的經驗和知識的專業人員隊伍來實現。根據客戶的需求提供報價。而且可以建議調整預算。美容斯堪的納維亞半島。', '2018-07-04 11:30:53'),
(415, 31, 'HARMON', 'เราส่งมอบความสุขผ่านถุงจักรยานและอุปกรณ์เสริม มีอุปกรณ์ปรับแต่งจักรยานสำหรับรายการอื่น ๆ อีกมากมาย\r\nเราเชื่อว่าการออกแบบที่เรียบง่ายกลมกลืนกันได้ดีกับทุกไลฟ์สไตล์ ดึงดูดการสัมผัสของแสง และวัสดุ ได้ดูน่าสนใจ\r\nกระเป๋า / กระเป๋าเดินทาง\r\n\r\nHARMON รับเย็บหนังแท้หุ้มแฮนด์\r\nรายละเอียด\r\n-หุ้มหนังแท้\r\n-จุกปลายแฮนด์ไม้', '1486095608-10603475_883955978392607_8426997878031646228_n.jpg', 'Online', 818, 3, 'ไม่ระบุ', 'harmonbags', 'harmonbags', '@harmonbags', 'harmon.bags@gmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1488220111-harman_timeline.jpg', 200, 2000, 'กระเป๋า / กระเป๋าเดินทาง / จักรยาน', 0, 0, 13.799434, 100.5503616, 0, 'We deliver happiness through bags, bike bags and accessories. Please stay tune for more items.\r\nWe believe simple design harmonizes well with every lifestyle, brings out characters and attracts a light touch of attention.\r\nBags/Luggage', '我們通過袋子，自行車袋和配件提供幸福。請繼續調整更多的項目。\r\n我們相信簡單的設計與每一種生活方式都很好地協調，帶來人物，並吸引了一絲輕鬆的注意。\r\n袋/行李', NULL),
(416, 19, 'LACHOPPERSBKK', 'ร้าน LACHOPPERS จำหน่ายสินค้า สำหรับ ชาวไบเกอร์ ของทางร้าน นำ เข้ามาจาก ต่างประเทศ\r\n\r\nแจ๊กเกทหนังแบรนด์ฝรั่งเศษ "HELSTON JACKET"\r\nแว่นสำหรับนักขับขี่จาก USA  "BOBSTER"\r\nถุงมือและรองเท้าบูท "AIXSTREAM"\r\nแว่นตาวินเทจจากอิตาลี "BURUFFALDI"\r\n"AVENGER HELMETS" มาตรฐานเดียวกับ JAPAN\r\n', '1486125958-16472965_10209808864112626_3471554301547238732_n.jpg', 'ห้องs295 JJMALL ', 689, 4, '081 563 6483', 'LACHOPPERSBKK', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'www.lachoppersbkk.com/', '1486125958-12.jpg', 200, 5000, 'CHOPPER,JACKET', 0, 0, 13.799434, 100.5503616, 0, '\r\nLACHOPPERS store sales for the BIKER of the shop brought in from abroad.\r\n\r\nJacks Gate brand French film "HELSTON JACKET".\r\nGlasses for driving from the USA "BOBSTER".\r\nGloves and boots, "AIXSTREAM".\r\nVintage sunglasses from Italy "BURUFFALDI".\r\n"AVENGER HELMETS" same standard JAPAN.', 'LACHOPPERS店銷售店的孟買歌手從國外帶來英寸\r\n\r\n傑克門品牌的法國電影“赫爾斯頓夾克”。\r\n眼鏡從美國“BOBSTER”駕駛。\r\n手套和靴子，“AIXSTREAM”。\r\n復古墨鏡來自意大利的“BURUFFALDI”。\r\n“AVENGER盔”相同的標準JAPAN。', NULL),
(417, 21, 'Pedmaison', 'ผลิตและจำหน่าย จานไม้ช้อนไม้ วัสดุทำจากไม้ยางพาราเกรดเอ ไม่ฉำฉ่า มีตลอดและโกดังสินค้า มีสินค้าพร้อมส่ง มีหน้ร้านชัดเจน จำหน่ายทั้งในราคาปลีก-ส่ง ผลิตและจำหน่าย จานไม้ ช้อนไม้ (ไม้คัดเกรดคุณภาพ)', '1486641780-14440904_1668436110134014_7836152122820536634_n.jpg', 'ตลาดจตุจักร โครงการ 11 เลขที่ 259-260', 1057, 3, '063 594 9799', 'pedmaison', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', '1486641780-1.jpg', 100, 500, 'จานไม้ช้อนไม้', 0, 0, 13.799434, 100.5503616, 0, 'Production and distribution Wood plate wooden spoon Made of rubber grade is not as juicy, spicy and warehouses. Availability There is a clear duty Available in both wholesale and retail - delivery. Manufacturing and selling wood plate wooden spoon (wood quality grading).', '生產和分配木板材木勺橡膠等級並不像多汁，辛辣和倉庫。可用性有一個明確的責任可在批發和零售 - 送貨。生產和銷售實木板木勺子（木材質量等級）。', NULL),
(418, 21, 'TIN HOME TOY', 'Tin Home toy ก่อตั้งขึ้นในปี 2010 เพื่อรองรับการอยู่อาศัยที่สะดวกสบายสำหรับบ้านของคุณ\r\nผลิตภัณฑ์ของเรามีฐานบนแผ่นชุบสังกะสีด้วยการสัมผัสที่อบอุ่นของไม้\r\nชิ้นส่วนทั้งหมดได้ทำด้วยมือและเป็นมิตรต่อสิ่งแวดล้อม\r\n\r\nด้วยการสนับสนุนจากพนักงานทุกคนในท้องถิ่นและซัพพลายเออร์ดีบุกบ้านของเล่นนำบรรยากาศขี้เล่นมีชีวิตชีวาให้กับบ้านของคุณกับทุกความรับผิดชอบต่อสภาพแวดล้อมของโลกของเรา :)\r\n\r\nเรามีความยากลำบากในการกำหนดหมวดหมู่ของผลิตภัณฑ์ของเรา\r\nแต่คุณจะได้พบกับพวกเขาทั้งหมดเป็นมิตรและห้องสวีทบ้านสไตล์วินเทจจากทุกสมัย\r\n\r\nเพลิดเพลินไปกับผลิตภัณฑ์ของเราและจะมีชีวิตชีวา :)\r\n\r\nstockist\r\nสยามพารากอนห้างสรรพสินค้า, การใช้ชีวิตฮอลล์ชั้น 4 กรุงเทพมหานคร\r\nสยามพารากอนห้างสรรพสินค้า, Be Trend ชั้น 3 กรุงเทพมหานคร\r\nLoft, Siam Discovery ชั้น 5 กรุงเทพมหานคร\r\nเอ็มโพเรี่ยม, Living Zone, ชั้น 5, Bangkok\r\nเดอะมอลล์บางกะปิ, เดอะลิฟวิ่งชั้น 3 กรุงเทพมหานคร\r\nโฮมโปรกรุงเทพมหานคร (ร้านค้าที่เลือกเท่านั้น)', '1486987575-14642226_1592146370808251_1599586363039604869_n.jpg', 'Online', 950, 5, '097 174 4774, 02 940 8840', 'tinhometoy', '@tinhometoy', 'tinhometoy', 'mail@tinhometoy.com', 'ไม่ระบุ', 'www.tinhometoy.com/', '1486987575-13495572_1506441396045416_4512490054248887035_o.jpg', 200, 5000, 'Galvanize steel home & garden decoration.', 0, 0, 13.799434, 100.5503616, 0, 'Tin Home Toy was established in 2010 to support cozy living for your home.\r\nOur products are base on galvanize sheets with warm touch of wood.\r\nAll pieces were hand-made and environmental friendly.\r\n\r\nWith all supports from local staffs and suppliers, Tin Home Toy brought lively playful atmosphere to your home with all responsible to our world environment :)\r\n\r\nWe have difficulties to define the category of our product\r\nbut you will find they are all friendly and suite every home style from vintage to modern.\r\n\r\nEnjoy our product and be lively :)\r\n\r\nStockist\r\nSiam Paragon Department Store, Living Hall, 4th Floor, Bangkok\r\nSiam Paragon Department Store, Be 