(421, 21, 'Praditfur', 'เราผลิตเฟอร์นิเจอร์ เพื่อตอบโจทย์ ในด้านของความคุ้มค่า กับดีไซน์ที่ลงตัว เหมาะสำหรับ ร้านอาหาร ร้านกาแฟ ตกแต่งบ้าน และคอนโด \r\nประดิษฐ์เฟอร์ อยากให้ทุกคนมีเฟอร์นิเจอร์เก๋ๆ และไม่แพงมา ไว้ใช้งานตอบโจทย์ด้านการลงทุน ด้วยสโลแกน "ราคาดี ดีไซน์ลงตัว" เฟอร์นิเจอร์ ราคาโดนๆ มาพร้อมดีไซน์ เฟอร์นิเจอร์เหล็ก', '1487119367-13508950_1430292016987966_8668379947150572455_n.jpg', 'Online', 674, 3, 'ไม่ระบุ', 'praditfur', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', '1487119367-14242365_1493909090626258_7336910501668472139_o.jpg', 2000, 5000, 'เฟอร์นิเจอร์', 0, 0, 13.799434, 100.5503616, 0, 'We produce furniture To meet In terms of value The design ideal for restaurants, coffee house and condo.\r\nArtificial fir I want everyone to have a stylish and affordable furniture into the needs of investors with the slogan "Design for a good fit," but it comes with design furniture. metal Furniture', '我們生產的家具為了滿足按價值計算該設計非常適合餐廳，咖啡館和公寓。\r\n人工杉木我想大家有一個時尚和實惠的家具到投資者的口號需要“為一個不錯的選擇設計，”但它與設計家具。金屬家具', NULL),
(422, 21, 'Surreal Rustic', 'เฟอร์นิเจอร์แนว Rustic & Industrial ผลิตจากไม้หมอนแท้พันธุ์หายาก วัสดุพรีเมี่ยม สำหรับตกแต่ง outdoor & indoor\r\nโต๊ะไม้หมอนสไตล์ minimal เรียบหรูแต่แฝงไปด้วยความดิบสไตล์ rustic โชว์ลวดลายเนื้อไม้ ยิ่งเก็บยิ่งเก่ายิ่งสวย พร้อมเหล็กหนาสุดๆเพื่อความปลอดภัยและทนทาน พร้อมทำสี powder coat เพิ่มความสวยงามและเพิ่มความทนทานต่อทุกสภาพอากาศทุกรูปแบบ เหมาะสำหรับตกแต่งในสวน และสถานที่ outdoor & indoor ทุกรูปแบบครับ\r\n', '1487122248-13906656_515636518633057_7642612288644694470_n.jpg', 'Online', 854, 3, '093 129 9999, 091 928 2850', 'surrealrustic', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'http://surrealrustic.com/', '1487122248-1.jpg', 2500, 20000, 'เฟอร์นิเจอร์แนว Rustic & Industrial', 0, 0, 13.799434, 100.5503616, 0, 'Rustic & Industrial furniture is made of genuine sleeper rare species. Premium materials, decorative outdoor & indoor.\r\nTable sleepers minimal style elegant yet rustic style show with raw wood pattern. The old store even more beautiful With thick steel top for safety and durability with black powder coat adds beauty and durability to weather any form. Perfect for decorating gardens and outdoor & indoor places all forms of it.', '質樸與工業家具是用真正的臥舖珍稀物種。優質材料，裝飾室內室外。\r\n表枕木簡約風格優雅而質樸的風格展現與原木格局。老店更美麗隨著厚鋼板頂部的安全性和耐用性，黑色粉末塗層增添了美感和耐用性天氣的任何形式。適合裝飾花園和戶外及室內場所一切形式的吧。', NULL),
(423, 20, 'Backyard', 'เราชื่นชมการเลือกเครื่องประดับที่มีมูลค่ามหาศาลซึ่งขายได้ที่ Backyard Jewellery ในตลาดนัดจตุจักร มันขี้เล่นน่ารักและแปลก ๆ เล็กน้อย คอลเลกชันมีเฉดสีของ Alice in Wonderland ด้วยต่างหู Cheshire Cat ที่น่ารักจี้ต่างหู White Rabbit และต่างหูดอกกุหลาบแดง ร้าน Backyard Jewellery ในจตุจักรยังมีสินค้าชิ้นใหม่ที่ทันสมัยสำหรับดูยามค่ำคืนที่มีความซับซ้อนแหวนอ้วนที่มีไข่มุกที่ห่อหุ้มไว้และจี้รังผึ้งที่มีแถบสีดำและขาว ให้แน่ใจว่าได้ค้นหาผ่านตะกร้าหวายที่ด้านหน้าของร้านในนั้นคุณจะพบคอลเลกชัน Backyard ของเสื้อยืดตกแต่งด้วยสัตว์น้ำสีและพิมพ์ผิดปกติ ราคาเริ่มต้นเพียง 300 บาทและเสื้อยืดเล็ก ๆ น้อย ๆ เริ่มต้นเพียง 150 บาทเท่านั้น', '1492003556-11181895_1153593947984256_8946450758753877026_n.jpg', 'ตลาดนัดสวนจตุจักร โครงการ 4 ซอย 1 เลขที่ 080 ', 918, 4, '086 392 6169', 'backyardstore', 'backyard_jewelry', 'ไม่ระบุ', ' in_the_backyard@hotmail.com', 'ไม่ระบุ', 'http://www.backyardjewelry.com/', '1492003556-Home1.jpg', 200, 5000, 'เครื่องประดับ/นาฬิกา', 0, 0, 13.799434, 100.5503616, 0, 'We adore the se in Wonderland ด้วยต่างหู Cheshire Cat ที่น่ารักจี้ต่างหู White Rabbit และต่างหูดอกกุหลาบแดง ร้าน Backyard Jewellery ในจตุจักรยังมีสินค้าชิ้นใหม่ที่ทันสมัยlection of great value jewellery that is on sale at Backyard Jewellery in Chatuchak Market. It’s playful, cute and slightly quirky. The collection has shades of Alice in Wonderland, with cute Cheshire Cat earrings, White Rabbit pendants and red rose earrings. As well as plenty of cute things, Backyard Jewellery’s Chatuchak shop also has some more modern pieces for sophisticated night-time looks, chunky rings with encrusted pearls and a beehive pendant with black and white stripes. Be sure to rummage through the wicker basket at the front of the shop, in it you will find Backyard collection of T-shirts decorated with watercolour animals and unusual prints. Prices are excellent, with costume jewellery prices starting at only 300 baht and cool little T shirts starting at only 150 baht.\r\n\r\nRead more at: http://www.bangkok.com/magazine/5-best-shops-chatuchak.htm?cid=ch:OTH:001', '我們喜歡在Chatuchak市場的Backyard Jewellery上出售的超值珠寶的選擇。它有趣，可愛，稍微古怪。收藏有愛麗絲夢遊仙境，配有可愛的柴郡貓耳環，白兔吊墜和紅玫瑰耳環。除了大量的可愛的東西，後院珠寶的Chatuchak店還有一些更現代的作品，用於精緻的夜間風格，大塊戒指鑲嵌珍珠，蜂巢吊墜配有黑色和白色條紋。一定要穿過商店前面的柳條籃，在這裡你會發現後院收集的水彩動物裝飾的T恤和不尋常的圖案。價格優惠，服裝珠寶價格從300泰銖開始，只有150泰銖開始出色的小T卹。', '2018-07-04 19:58:31'),
(424, 19, 'Guate Leather', 'ร้านขายเครื่องหนังที่มีสีสันนี้มีลายเซ็น Paul Smith อันน่าพิศวงบางอย่างที่ซุ้มของร้านค้าซึ่งดึงดูดสายตาของคุณ แต่ไม่มากเท่ากระเป๋าถือหนังที่สวยงามที่แขวนไว้จากเพดาน คุณภาพของหนังและฝีมือเป็นที่น่าอัศจรรย์ แต่ Guate ยังปล่อยเฉพาะถุงของพวกเขาในระยะที่ จำกัด ดังนั้นคุณจึงไม่น่าจะจุดทุกคนที่มีถุงเดียวกันโดยเฉพาะอย่างยิ่งพวกเขามาในสีรุ้ง กระเป๋ามีขนาดตั้งแต่หัวไหล่ขนาดเล็กไปจนถึงผู้ซื้อที่มีขนาดใหญ่ นอกจากนี้ยังมีกระเป๋าสตางค์กระเป๋าสตางค์พวงกุญแจและกระเป๋าเป้สะพายหลังเพื่อให้มีบางอย่างสำหรับทุกคน ในการเดินทางครั้งล่าสุดเราพบกระเป๋าถือทรงโค้งที่สวยงามขนาดใหญ่พอที่จะพกติดตัวไปได้ทั้งหมด แต่ยังดูสง่างามและมีคุณภาพตัดเป็นราคาเพียง 4,000 บาทเท่านั้น', '1492005978-14882188_1340813775942207_5769381835362354448_o.jpg', 'ตลาดนัดจตุจักร โครงการ 24 ซอย 33\r\n\r\n', 3196, 4, '062 637 2223, 062 637 2224', 'Guateleather', 'guateleather', 'ไม่ระบุ', 'guate95@gmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1492005978-10535787_932425120114410_8604321316262874578_o.jpg', 1000, 5000, 'กระเป๋า/กระเป๋าเดินทาง', 0, 1, 13.799434, 100.5503616, 0, 'This colourful leather goods store has some funky Paul Smith inspired stripes on the shop facade that catch your eye, but not quite as much as the stunning leather handbags that hang from the ceiling. The quality of the leather and craftsmanship is amazing, but Guate also only release their bags in a limited run, so you are unlikely to spot anyone else with the same bag, especially as they come in a rainbow of colours. The bags range in size from small shoulder clutches to roomy shoppers. There are also a range of wallets, purses, key chains and rucksacks, so there is something for everyone. On our last trip there we spotted a beautiful curved handbag, large enough to carry all my paraphernalia but still look chic, and given the quality, a snip at only 4,000 baht.\r\n\r\nRead more at: http://www.bangkok.com/magazine/5-best-shops-chatuchak.htm?cid=ch:OTH:001', '\r\n這個五顏六色的皮具商店有一些時髦的保羅·史密斯在商店門面的靈感條紋，吸引你的眼睛，但不如從天花板懸掛的令人驚嘆的皮革手袋那麼多。皮革和工藝的質量是驚人的，但是貴國也只是在有限的運行中釋放他們的行李，所以你不可能發現任何其他人用同樣的包，特別是當他們來到彩虹的顏色。袋子的尺寸從小肩膀離合器到寬敞的購物者。還有一系列錢包，錢包，鑰匙鍊和背包，所以每個人都有東西。在我們的最後一次旅行中，我們發現了一個美麗的彎曲手提包，足夠大，可以攜帶我的所有工具，但仍然看起來別緻，給予質量，一個只有4000泰銖的剪輯。', NULL),
(425, 20, 'Thammada Studio', 'ร้านเครื่องประดับดีไซน์เรียบง่ายแต่มากด้วยความหมายที่ซ่อนอยู่ภายใน ชิ้นงานทุกชิ้นเป็นเหมือนตัวแทนการเล่าเรื่องราวต่างๆออกมาได้อย่างลงตัว ไม่ว่าจะเป็นแหวน สร้อย ต่างหู หรือ จี้ ทุกๆชิ้นล้วนมีที่มาที่ไป รวมถึงคุณภาพของวัสดุที่ก็ยอดเยี่ยมไม่แพ้เรื่องของการออกแบบ จนได้รับรางวัลการันตีมากมาย และถ้าใครที่ไม่อยากไปเดินตากแดดร้อนๆถึงที่ตลาด Thammada Studio ก็มีช่องทางการซื้อของผ่าน ShopSpot: https://goo.gl/m42kF4\r\n\r\nซึ่งสามารถชำระเงินผ่านบัตรเครดิตและเดบิตได้ สะดวกสุดๆไปเลย!\r\n\r\nSpecial Promotion รับส่วนลด 100 บาททันที "ไม่มีขั้นต่ำ" เมื่อซื้อสินค้าใน ShopSpot เพียงใส่โค้ด SS-JJ', '1495144917-16825942_614737798727442_6619005364411043487_o.jpg', 'ตลาดนัดจตุจักร โครงการ 2 เลขที่ 178 ', 1572, 5, 'ไม่ระบุ', 'Thammada.studio', 'thammada_design', 'ไม่ระบุ', 'thammada.design@gmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1495144917-1.jpg', 1000, 4000, 'ORIGINALITY / DEEP HEART / ECLECTIC.', 0, 0, 13.799434, 100.5503616, 0, 'In Thai Word - meaning is normal and ordinary.\r\nBut we concentrate to design and inspired from general story with the new concept and present it on jewelry.\r\nORIGINALITY / DEEP HEART / ECLECTIC. \r\n\r\ndesign objects and present with concept jewelry. \r\n', '珠寶店設計非常簡單，但含義內隱藏。所有部件作為故事的代理人完全走了出來。它是否是一個戒指，項鍊，耳環或吊墜，每一塊都回來。材料的質量非常好，而不是設計。獲獎的品種。 https://goo.gl/m42kF4：如果有人不希望走在烈日市場Thammada Studio還通過ShopSpot購買渠道。\r\n\r\n這可以通過信用卡和借記卡支付。安慰我！\r\n\r\n特價促銷折扣100銖立竿見影“沒有”最低收購價只是ShopSpot碼SS-JJ的。', NULL),
(426, 18, 'Simple Son', 'Simple Son Fabric handmade bottons....\r\nในความเรียบง่าย แต่ยังคงความมีเอกลักษณ์\r\nเสื้อของเราทุกตัวใช้กระดุมผ้าที่แข็งแรง เพราะปั๊มกระดุมด้วยมือทุกชิ้น คงทน ใช้งานได้ปกติ ไม่ต้องห่วงว่าจะหลุดง่าย สามารถนำเสื้อซักกับเครื่องซักผ้าได้ปกติ', '1495146410-13096009_837680103010824_2907218811627157973_n.jpg', 'ตลาดนัดสวนจตุจักร โครงการ4 ซ.47/1', 782, 4, '094 549 0801', 'Simplesonjj', 'simplesonjj', 'simplesonjj', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', '1495146410-1.jpg', 500, 2500, 'ปั๊มกระดุมด้วยมือทุกชิ้น', 0, 0, 13.799434, 100.5503616, 0, 'Simple Son Fabric handmade bottons ....\r\nIn simplicity But still unique\r\nAll our shirts have strong buttons. Because the pump button with all hands are durable normal use. Do not worry, it will fall easily. Can wash clothes with washing machine regularly.', '簡單兒子面料手工bottons....\r\n在簡單但是，仍然是獨一無二的\r\n我們所有的襯衫鈕扣，織物強度。因為每手釘耐用泵工作正常。別擔心，它會很容易脫落。襯衫可以用常規洗衣機洗滌。', NULL),
(427, 19, 'Amazeshoes', 'อีกหนึ่งแบรนด์รองเท้าหนังสไตล์วินเทจสำหรับสาวๆที่หลงใหลในความคลาสสิค มีทั้งทรงปกติทั่วไปและทรงที่เอกลักษณ์เฉพาะของทางร้าน ซึ่งไม่สามารถหาจากที่อื่นได้ แถมมีสีสันให้เลือกมากมายตั้งแต่คุมโทนขาว ดำ น้ำตาล ไปจนถึงสีเจ็บๆอย่างส้ม เหลือ แดง บอกเลยว่าครบทุกความต้องการเรื่องรองเท้าจริงๆ', '1497874143-1275153_624830004224616_858134889_o.jpg', 'ตลาดนัดจตุจักร ติดกับ MRT สถานีกำแพงเพชร ทางออกที่ 2', 1054, 4, 'ไม่ระบุ', 'Amazeshoes', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', '1497874143-1275153_624830004224616_858134889_o.jpg', 500, 3500, 'รองเท้าหนัง', 0, 1, 13.799434, 100.5503616, 0, 'Another brand of vintage leather shoes for girls who are passionate about the classic. Both normal and unique style of the shop. Which can not be found elsewhere. There are many colors to choose from the mono, black and white sugar to painfully orange red color to say that all the needs of shoes really.', '女孩誰是熱衷於經典的另一個品牌的復古皮鞋。店鋪的正常和獨特的風格。無法找到其他地方。有多種顏色可供單，黑，白砂糖桔痛苦紅色可供選擇地說，所有的鞋子的需求真的。', NULL),
(428, 19, 'Tint Berries', 'อีกแบรนด์กระเป๋าน่ารักๆเหมาะกับสาวๆที่รักในแฟชั่นทุกคน เรียกได้ว่ามาร้านเดียวมีกระเป๋าให้เลือกแทบทุกทรงไม่ว่าจะเป็นกระเป๋าถือ สะพายข้าง หรือเป้สะพายหลัง ร้านนี้ก็มีหมด แถมรูปทรงและสีสันต่างๆก็ดูดีเป็นที่สะดุดตาสุดๆ และในวันวาเลนไทน์ที่จะถึงนี้ทางร้านก็มีโปรโมชั่นพิเศษมาเอาใจคู่รักทุกคู่กันอีกด้วย\r\n', '1497876734-13501735_1036909606386572_8413475889794673575_n.jpg', 'ตลาดนัดจตุจักร โครงการ 2 ห้องเลขที่ 222 ซอย 40/2', 571, 3, 'ไม่ระบุ', 'Tintberrybag', 'tint_berries', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', '1497876734-13686499_1056950774382455_8387407983922668963_n.jpg', 250, 2500, 'กระเป๋า', 0, 0, 13.799434, 100.5503616, 0, '\r\nAnother brand of cute bags suitable for girls who love fashion. Called a single store with a choice of bags, whether it is a shoulder bag or backpack. This shop is empty. The shapes and colors are good, it is eye-catching. And on Valentine\'s Day, there will be special promotions to pamper all couples together.', '另一個品牌的可愛包包適合女性愛時尚。被稱為一個單獨的商店，可以選擇包包，無論是單肩包還是背包。這家店是空的形狀和顏色都很好，引人注目。在情人節那天，會有特別的促銷活動，讓所有夫婦一起享受。', NULL),
(429, 18, 'ZombieVilla', 'Zombie Villa\r\nและนี่คือสถานที่รวบรวมไว้ทั้งเสื้อผ้าผู้ชายและผู้หญิงในร้านเดียวกัน โดยจะเน้นที่ลายกราฟฟิคเท่ๆผสมกับกลิ่นอายวินเทจนิดๆ ผสมผสานกันอย่างลงตัว', '1497877674-18076779_1249550151832931_7440792498845817972_o.jpg', '238-248 โครงการ 2 ตลาดนัดจตุจักร', 430, 3, '092 356 6615', 'ZombieVilla', 'zombievilla', 'ไม่ระบุ', 'zombievillashop@gmail.com', 'ไม่ระบุ', 'ไม่ระบุ', '1497877674-18076779_1249550151832931_7440792498845817972_o.jpg', 200, 1500, 'เสื้อ', 0, 0, 13.799434, 100.5503616, 0, 'Zombie Villa\r\nAnd this is the place to gather both men\'s and women\'s clothes in the same store. The emphasis is on the cool graphics mixed with a little vintage. Blend together for example.', '殭屍別墅\r\n這是在同一個車間男性和女性的聚集地。它強調圖形涼著一點點復古的氣息混合。完美融合', NULL),
(430, 19, 'Mywarisa', 'ร้านรองเท้าผ้าใบสุดน่ารักสำหรับสาวๆ ที่โดดเด่นทั้งลวดลายและสีสันที่ลงตัว และที่พิเศษกว่านั้นคือทางร้านจะมีการ Collab กับนักวาดที่มีชื่อเสียงต่างๆเพื่อร่วมกันทำคอลเล็คชั่นใหม่ๆออกมาอย่างต่อเนื่อง เช่น mywarisa x BRANDNEW ของคุณนิว เดอะสตาร์ เรียกได้ว่าพรีเมี่ยมสุดๆ รองเท้าทุกคู่ทำด้วยมือทุกขั้นตอนนะ และคัดเลือกวัสดุที่ดีที่สุดมาใช้เป็นส่วนประกอบของรองเท้า จึงมั้นใจว่ารองเท้าของ mywarisa ทุกคู่จะเป็นรองเท้าที่สวย ทนทาน และใส่สบาย พร้อมจะเดินไปกับทุกก้าวของสาวๆ', '1505354528-odakyu.jpg', 'ตลาดนัดจตุจักร No.237, ซอย 40/2, โครงการ 2', 577, 3, '02 115 3562', 'Mywarisa', 'mywarisa', 'mywarisashop', 'mywarisa@hotmail.com', 'ไม่ระบุ', 'http://www.mywarisa.com/', '1505355023-77.jpg', 250, 2000, 'รองเท้า', 0, 0, 13.799434, 100.5503616, 0, 'Lovely shop shoes for women. Featured both color and design perfect. And more special is that the store will have Collab to draw various famous together to do all the new edition out continuously. Such as mywarisa x BRANDNEW your new star is called premium totally.', '运动鞋商店最可爱的女孩其完美的图案和颜色。更特殊的是，商店将与著名的艺术家Collab共同联系，不断推出新的电子数据解决方案新的明星如mywarisa x称BRANDNEW溢价。', NULL),
(434, 30, 'At 345 by Yorwor', 'ชื่อบ่งบอกถึงทำเลที่ตั้งของร้านที่อยู่ในตลาดนัดสวนจตุจักร โครงการที่ 3 ซอย 45 จึงจับมามัดรวมกันได้เป็นชื่อร้านเช่นนี้ สังเกตง่ายๆ ด้วยการมองหาโลโก้ร้านรูป “สุนัขบูลด็อก” เด่นตระหง่านภายในร้าน ... อ้อแล้วก็ถ้าโชคดีมีโอกาสได้เจอเจ้าของภาพตัวเป็นๆ อย่าลืมเข้าไปทักทายถ่ายรูปเล่นได้ บรรยากาศภายในร้านรองรับได้กว่า 20 โต๊ะ ทั้งในรูปแบบเคาน์เตอร์บาร์และโต๊ะที่นั่งแบบปกติ ตกแต่งแบบสบายๆ ด้วยแนวคิดของเจ้าของร้านซึ่งเป็นกลุ่มเพื่อนจากโรงเรียนหาดใหญ่วิทยาลัย. มารวมตัวกันดีไซน์ให้ร้านเป็นจุดรวมตัวของเหล่าบรรดาเพื่อนฝูง ญาติสนิท มิตรสหาย ที่มานัดเจอกัน ณ ที่แห่งนี้  @345 By YORWOR เปิดให้บริการมาแล้วกว่า 3 ปี ซึ่งเมนูอาหารส่วนใหญ่เป็นรูปแบบฟิวชั่นอิตาเลียน ตามคอนเซ็ปต์ที่ว่า “Italian fusion food style” แต่ถึงกระนั้นก็มีอาหารไทยให้ได้ลิ้มลองอีกหลากหลายเมนูซึ่งรวมทั้งหมดแล้วมีให้เลือกกว่า.50 รายการ พร้อมเมนูพิเศษประจำวันให้ได้เซอร์ไพรส์ไม่ซ้ำเมนู.. ไฮไลต์เด็ดที่เรียกว่าเป็นเมนูสามัญประจำร้านและห้ามพลาดด้วยประการทั้งปวง เริ่มต้นที่เมนูออร์เดิร์ฟรับประทานเล่นเรียกน้ำย่อย ได้แก่ ซีซาร์สลัดไก่ทอด @345ไส้กรอก เปาะเปี๊ยะกุ้ง ตามมาด้วยอาหารจานหลัก ได้แก่ ข้าวเหนียวมะม่วง วาฟเฟิลไอศกรีมและกล้วย และน้ำกระเจี๊ยบมะนาวเสิร์ฟในกระบอกไม้ไผ่ทรงสูง แต่ละเมนูได้คัดเลือกวัตถุดิบนำมาปรุงได้ดีและสดใหม่เสมอ ทำให้รสชาติอาหารทุกจานออกมามีคุณภาพ เสมือนทำให้คนในครอบครัวได้อิ่มอร่อยอย่างมีความสุข ข้าวเหนียวมะม่วง วาฟเฟิลไอศกรีมและกล้วย และน้ำกระเจี๊ยบมะนาวเสิร์ฟในกระบอกไม้ไผ่ทรงสูง แต่ละเมนูได้คัดเลือกวัตถุดิบนำมาปรุงได้ดีและสดใหม่เสมอ ทำให้รสชาติอาหารทุกจานออกมามีคุณภาพ เสมือนทำให้คนในครอบครัวได้อิ่มอร่อยอย่างมีความสุข.', '1514965271-01.jpg', 'ตลาดนัดจตุจักร โครงการ 3 ซอย 45', 376, 1, '086 967 0617', 'At345-by-Yorwor', 'ไม่ระบุ', 'ไม่ระบุ', 'ไม่ระบุ', NULL, 'ไม่ระบุ', '1514965271-02.jpg', 0, 0, 'Italian / Thai Fusion Foods style', 0, 0, 13.799434, 100.5503616, 0, '顯示名字的位置第3週末市場店地址在SOI 45抓住項目捆綁組合這種簡單是一個商店的名字。以尋找“牛頭犬”標誌的商店，店內占主導地位的雄偉……哦，如果你幸運的話，有機會見到老闆。別忘了問候，拍照，玩了在店內的氣氛20支持超過錶在傳統的吧台，茶几上隨意的裝潢。的概念是從學校的朋友hatyaiwittayalai店主。在我們的設計目的是讓那些店給朋友來見朋友約會，你在345 YORWOR @在過去的一年3開放。這是選單，融合模型的主